INSERT INTO `system_mail_layouts` (`id`, `name`, `code`, `content_html`, `content_text`, `content_css`, `is_locked`, `options`, `created_at`, `updated_at`) VALUES
(1, 'Default layout', 'default', '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\r\n</head>\r\n<body>\r\n\r\n    {% set base_cdn_url = \'http://50.28.10.160/cdn/np/\' %}\r\n\r\n    <style type=\"text/css\" media=\"screen\">\r\n        {{ brandCss|raw }}\r\n        {{ css|raw }}\r\n    </style>\r\n\r\n    <table class=\"wrapper layout-default\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n\r\n        <!-- Header -->\r\n        {% partial \'header\' body %}\r\n            {{ subject|raw }}\r\n        {% endpartial %}\r\n\r\n        <tr>\r\n            <td align=\"center\">\r\n                <table class=\"content\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n                    <!-- Email Body -->\r\n                    <tr>\r\n                        <td class=\"body\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n                            <table class=\"inner-body\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\">\r\n                                <!-- Body content -->\r\n                                <tr>\r\n                                    <td class=\"content-cell\">\r\n                                        {{ content|raw }}\r\n                                    </td>\r\n                                </tr>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n\r\n        <!-- Footer -->\r\n        {% partial \'footer\' body %}\r\n            &copy; {{ \"now\"|date(\"Y\") }} {{ appName }}. All rights reserved.\r\n        {% endpartial %}\r\n\r\n    </table>\r\n\r\n</body>\r\n</html>', '{{ content|raw }}', '@media only screen and (max-width: 600px) {\r\n    .inner-body {\r\n        width: 100% !important;\r\n    }\r\n\r\n    .footer {\r\n        width: 100% !important;\r\n    }\r\n}\r\n\r\n@media only screen and (max-width: 500px) {\r\n    .button {\r\n        width: 100% !important;\r\n    }\r\n}', 1, '{\"disable_auto_inline_css\":\"0\"}', '2019-07-12 10:19:07', '2019-08-09 01:20:49'),
(2, 'System layout', 'system', '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\r\n</head>\r\n<body>\r\n    <style type=\"text/css\" media=\"screen\">\r\n        {{ brandCss|raw }}\r\n        {{ css|raw }}\r\n    </style>\r\n\r\n    <table class=\"wrapper layout-system\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n        <tr>\r\n            <td align=\"center\">\r\n                <table class=\"content\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n                    <!-- Email Body -->\r\n                    <tr>\r\n                        <td class=\"body\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n                            <table class=\"inner-body\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\">\r\n                                <!-- Body content -->\r\n                                <tr>\r\n                                    <td class=\"content-cell\">\r\n                                        {{ content|raw }}\r\n\r\n                                        <!-- Subcopy -->\r\n                                        {% partial \'subcopy\' body %}\r\n                                            **This is an automatic message. Please do not reply to it.**\r\n                                        {% endpartial %}\r\n                                    </td>\r\n                                </tr>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </table>\r\n\r\n</body>\r\n</html>', '{{ content|raw }}\r\n\r\n\r\n---\r\nThis is an automatic message. Please do not reply to it.', '@media only screen and (max-width: 600px) {\r\n    .inner-body {\r\n        width: 100% !important;\r\n    }\r\n\r\n    .footer {\r\n        width: 100% !important;\r\n    }\r\n}\r\n\r\n@media only screen and (max-width: 500px) {\r\n    .button {\r\n        width: 100% !important;\r\n    }\r\n}\r\n\r\n.red li {color:red}', 1, '{\"disable_auto_inline_css\":\"0\"}', '2019-07-12 10:19:07', '2019-08-01 22:33:11'),
(3, 'NP Theme', 'notice', '<!doctype html>\r\n<html lang=\"en\">\r\n  <head>\r\n    <!-- Required meta tags -->\r\n    <meta charset=\"utf-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, shrink-to-fit=no\">\r\n\r\n    <!-- Bootstrap CSS -->\r\n    <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\" integrity=\"sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T\" crossorigin=\"anonymous\">\r\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.11.2/css/all.min.css\" integrity=\"sha256-+N4/V/SbAFiW1MPBCXnfnP9QSN3+Keu+NlB+0ev/YKQ=\" crossorigin=\"anonymous\" />\r\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\" integrity=\"sha256-eZrrJcwDc/3uDhsdt61sL2oOBY362qM3lon1gyExkL0=\" crossorigin=\"anonymous\" />\r\n    <link rel=\"stylesheet\" href=\"{{global.theme_path}}/css/youtube-video-gallery.css\">\r\n    \r\n\r\n    <title>{{domain}}</title>\r\n    \r\n    <style type=\"text/css\" media=\"screen\">\r\n        \r\n         {{ css|raw }}\r\n               \r\n    </style>\r\n  </head>\r\n  \r\n  <body class=\"theme-{{global.theme}} site-{{global.site_id}} {{domain}}\">\r\n  \r\n      <div class=\"container {{body_css}}-page\">\r\n        <div class=\"row\" >\r\n            <div class=\"col\">\r\n                <div id=\"top\">\r\n                     {% partial \'site-top-blocks\' lang=lang body %}\r\n                     {% endpartial %}     \r\n                </div>\r\n            </div>\r\n        </div>\r\n         <div class=\"row\" >\r\n            <div class=\"col\">\r\n                <div id=\"flash\">\r\n                     {% partial \'site-flash-blocks\' lang=lang body %}\r\n                     {% endpartial %}   \r\n                </div>\r\n            </div>\r\n        </div>\r\n         <div class=\"row\" >\r\n            <div class=\"col\">\r\n                <div id=\"left\">\r\n                    {{content|raw}}\r\n                </div>\r\n            </div>\r\n            \r\n            {% set disabled_right_bar = record.item.is_right_side_bar %}\r\n            {% if not disabled_right_bar %}\r\n                <div class=\"right-side-bar col-3\">\r\n                    <div id=\"right\">\r\n                        {% partial \'site-right-blocks\' url=url domain=domain lang=lang body%}\r\n                        {% endpartial %}\r\n                    </div>\r\n                </div>\r\n            {% endif %}\r\n        </div>\r\n         <div class=\"row\" >\r\n            <div class=\"col\">\r\n                <div id=\"bottom\">\r\n                     {% partial \'site-bottom-blocks\' lang=lang body %}\r\n                     {% endpartial %}\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    <!-- Optional JavaScript -->\r\n    <!-- jQuery first, then Popper.js, then Bootstrap JS -->\r\n    <!-- <script src=\"https://code.jquery.com/jquery-3.3.1.slim.min.js\" crossorigin=\"anonymous\"></script> -->\r\n    <script src=\"https://code.jquery.com/jquery-3.3.1.min.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/js/bootstrap.min.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"{{global.theme_path}}/js/simple-ticker.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"{{global.theme_path}}/js/responsiveslides.min.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"{{global.theme_path}}/js/jquery.youtubevideogallery.js\" crossorigin=\"anonymous\"></script>\r\n    <script src=\"{{global.theme_path}}/js/app.js\" crossorigin=\"anonymous\"></script>\r\n    <script>\r\n\r\n        $(document).ready(function() {\r\n        \r\n           $.simpleTicker($(\"#news-ticker\"),{\r\n              delay : 2000,\r\n              effectType : \'roll\'\r\n           });\r\n           \r\n           $(\"#ad-slider\").responsiveSlides();\r\n           $(\"#banner-slider\").responsiveSlides();\r\n           \r\n        });  \r\n        \r\n        //for video gallary\r\n        $(document).ready(function(){\r\n            $(\"ul.youtube-videogallery\").youtubeVideoGallery({\r\n                \r\n    			title:\'default\',\r\n                iframeTemplate: \'<div class=\"iframe\"><div class=\"close\"><a href=\"#\">CLOSE</a></div><iframe title=\"Youtube video player\" id=\"youtube-videogallery-iframe\" style=\" height: {options.innerHeight}px; width: {options.innerWidth}px;\" frameborder=\"0\" src=\"about:blank\"></iframe></div>\'\r\n            \r\n            });\r\n            \r\n            //close the iframe\r\n            $(\".close a\").click(function (e) {\r\n                e.preventDefault();\r\n                $(\".youtube-videogallery-bodycover\").trigger(\"click\");\r\n            });\r\n        \r\n        });\r\n\r\n        \r\n    </script>\r\n  </body>\r\n</html>', '', '@font-face {\r\n  font-family: \"kalpurushregular\";\r\n  src: url(\"http://50.28.10.160/cdn/np/fonts/Kalpurush.eot\");\r\n  src: url(\"http://50.28.10.160/cdn/np/fonts/Kalpurush.woff\") format(\"woff\"),\r\n    url(\"http://50.28.10.160/cdn/np/fonts/Kalpurush.ttf\") format(\"truetype\"),\r\n    url(\"http://50.28.10.160/cdn/np/fonts/Kalpurush.svg#Kalpurush\") format(\"svg\"),\r\n    url(\"http://50.28.10.160/cdn/np/fonts/Kalpurush.eot?#iefix\") format(\"embedded-opentype\");\r\n  font-weight: normal;\r\n  font-style: normal;\r\n}\r\n\r\n\r\n.text-green{color:limegreen}\r\n\r\nbody {\r\n  font-family: kalpurushregular;\r\n  margin: 0;\r\n  font-weight: 400;\r\n  line-height: 1.5;\r\n  text-align: left;\r\n  background-color: #fff;\r\n  font-size: 16px;\r\n  color: #000;\r\n}\r\n\r\n#left-content ul {\r\n  list-style: disc;\r\n}\r\n\r\nul,\r\nol {\r\n  margin-bottom: 20px;\r\n}\r\n\r\nli {\r\n  line-height: 18px;\r\n  margin-bottom: 12px;\r\n}\r\n\r\nh5 {\r\n  font-size: 17px;\r\n  line-height: 24px;\r\n}\r\n\r\n\r\n\r\nhtml,\r\nbody,\r\ndiv,\r\nspan,\r\napplet,\r\nobject,\r\niframe,\r\nh1,\r\nh2,\r\nh3,\r\nh4,\r\nh5,\r\nh6,\r\np,\r\nblockquote,\r\npre,\r\na,\r\nabbr,\r\nacronym,\r\naddress,\r\nbig,\r\ncite,\r\ncode,\r\ndel,\r\ndfn,\r\nem,\r\nimg,\r\nins,\r\nkbd,\r\nq,\r\ns,\r\nsamp,\r\nsmall,\r\nstrike,\r\nstrong,\r\nsub,\r\nsup,\r\ntt,\r\nvar,\r\nb,\r\nu,\r\ni,\r\ncenter,\r\ndl,\r\ndt,\r\ndd,\r\nol,\r\nul,\r\nli,\r\nfieldset,\r\nform,\r\nlabel,\r\nlegend,\r\ntable,\r\ncaption,\r\ntbody,\r\ntfoot,\r\nthead,\r\ntr,\r\nth,\r\ntd,\r\narticle,\r\naside,\r\ncanvas,\r\ndetails,\r\nembed,\r\nfigure,\r\nfigcaption,\r\nfooter,\r\nheader,\r\nhgroup,\r\nmenu,\r\nnav,\r\noutput,\r\nruby,\r\nsection,\r\nsummary,\r\ntime,\r\nmark,\r\naudio,\r\nvideo {\r\n  margin: 0;\r\n  padding: 0;\r\n  border: 0;\r\n   \r\n  vertical-align: baseline;\r\n}\r\n\r\na,\r\na:visited {\r\n  color: #333;\r\n  text-decoration: none;\r\n  outline: 0;\r\n}\r\n\r\n.btn {\r\n  background-image: linear-gradient(to bottom, #666, #a6a6a6);\r\n  background-repeat: repeat-x;\r\n  border-color: rgba(0, 0, 0, 0.1) rgba(0, 0, 0, 0.1) #a2a2a2;\r\n  padding: 0 5px;\r\n  color: #fff;\r\n  background-color: #a6a6a6;\r\n}\r\n\r\n.right {\r\n  float: right;\r\n}\r\n\r\n#contents .block {\r\n  overflow: hidden;\r\n  width: 100%;\r\n}\r\n\r\n.block {\r\n  margin-bottom: 10px;\r\n  font-size: 13px;\r\n}\r\n\r\n.right-side-bar .block img {\r\n  margin: 0 5px 0 0;\r\n}\r\n\r\n.right-side-bar {\r\n    padding-top: 15px;\r\n}\r\n\r\n.service-row {\r\n  margin-bottom: 20px;\r\n  margin-top: 20px;\r\n}\r\n\r\n.block .title {\r\n  padding: 5px;\r\n  font-size: 1.2em;\r\n  background-color: #609513;\r\n  color: #fff;\r\n  line-height: 24px;\r\n}\r\n\r\n.block table td {\r\n  box-sizing: border-box;\r\n  padding: 5px;\r\n  border: 1px solid #d8d8d8;\r\n}\r\n\r\n.block h5 {\r\n  font-weight: bold;\r\n  margin-bottom: 10px;\r\n  font-size: inherit;\r\n}\r\n\r\n.job-block {\r\n  margin-bottom: 10px;\r\n}\r\n\r\n.job-block .apply-online {\r\n  border-bottom-style: solid;\r\n  border-bottom-width: 5px;\r\n  color: #ffffff;\r\n  font-size: 15px;\r\n  line-height: 1.2;\r\n  margin-bottom: 10px;\r\n  padding-bottom: 15px;\r\n  padding-top: 15px;\r\n  text-align: center;\r\n}\r\n\r\n.job-block .apply-online a {\r\n  color: #683091;\r\n  text-decoration: none;\r\n}\r\n\r\nsup {\r\n  font-size: xx-small;\r\n  vertical-align: super;\r\n}\r\n\r\n.service-list > h5 {\r\n  padding: 5px;\r\n  font-size: 1.2em;\r\n  overflow: hidden;\r\n}\r\n.service-list > ul {\r\n  padding: 10px 0;\r\n  margin: 0;\r\n}\r\n\r\n.service-list .title {\r\n  font-weight: bold;\r\n  margin-bottom: 10px;\r\n  background-attachment: scroll;\r\n  background-clip: border-box;\r\n  background-image: url(\"http://50.28.10.160/cdn/np/images/central_e_service.jpg\");\r\n  background-origin: padding-box;\r\n  background-position-x: 0px;\r\n  background-position-y: 0px;\r\n  background-repeat: no-repeat;\r\n  background-size: cover;\r\n  margin-top: 0;\r\n  padding-left: 35px !important;\r\n  border: 1px solid #ccc;\r\n  color: #683091;\r\n}\r\n\r\n.service-list ul li {\r\n  background-position: left;\r\n\r\n  font-size: 120%;\r\n  height: auto;\r\n  list-style-type: none;\r\n  margin-bottom: 5px;\r\n  padding-left: 2px;\r\n  padding-top: 0px;\r\n  padding-bottom: 8px;\r\n  line-height: 18px;\r\n}\r\n\r\n.service-list ul li a {\r\n  font-size: 16px;\r\n  text-decoration: none;\r\n}\r\n\r\n.service-list > h5 {\r\n    padding: 5px;\r\n    font-size: 1.2em;\r\n}\r\n\r\n.social img {\r\n  margin: 0 5px 0 0;\r\n  width: 30px;\r\n}\r\n\r\n.footer-artwork {\r\n  background: url(\"http://50.28.10.160/cdn/np/images/footer_top_bg.png\") no-repeat scroll 0 0\r\n    rgba(0, 0, 0, 0);\r\n  height: 84px;\r\n  margin: 0 auto;\r\n  width: 1020px;\r\n  clear: both;\r\n}\r\n\r\n.footer-wrapper {\r\n  background-color: #ebebeb;\r\n  height: 100px;\r\n  margin: 0 auto;\r\n}\r\n\r\n.footer-menu {\r\n  display: flex;\r\n  justify-content: space-between;\r\n  padding: 15px;\r\n}\r\n\r\n.footer-menu .last-update {\r\n  font-size: 0.9em;\r\n}\r\n\r\n.footer-menu .last-update .date {\r\n  font-style: italic;\r\n}\r\n\r\n.footer-credit {\r\n  float: right;\r\n  font-size: 0.8em;\r\n  text-align: right;\r\n}\r\n.list .title {\r\n    padding: 15px 0;\r\n    font-size: 24px;\r\n}\r\n.list .pagination li {\r\n    margin-right: 10px;    \r\n}\r\n\r\n.list .pagination .disabled {\r\n    color: #ccc\r\n}\r\n.list table td {\r\n    padding: 10px;\r\n}\r\n.details {\r\n    padding: 20px 0;\r\n}\r\n\r\n.control-file img {\r\n    height: 15px;\r\n    width: 15px;\r\n}\r\ntable.content-type-list td[scope=\'row\'] {\r\n    white-space: nowrap;\r\n}\r\n\r\n.box {\r\n    background-color: #f5f5f5;\r\n    border: 1px solid #ccc;\r\n}\r\n\r\n.list > li {\r\n    padding: 5px 0;\r\n    margin: 0;\r\n}\r\n\r\n\r\n.ticker {\r\n  /* margin: 0 auto;\r\n  padding: 10px;\r\n  width: 600px;\r\n  text-align: left;\r\n  border: #ccc 1px solid;\r\n  position: relative;\r\n  overflow: hidden;\r\n  background-color:#ffffff; */\r\n}\r\n\r\n.ticker ul {\r\n  width: 100%;\r\n  position: relative;\r\n}\r\n\r\n.ticker ul li {\r\n  width: 100%;\r\n  display: none;\r\n}\r\n\r\n.details-page .label {font-weight:bold}\r\n\r\n/*for video gallary*/\r\n.close a{float: right;color: #fff}\r\n.close {float: none}\r\n\r\n/* details page */\r\n\r\n.details-page .title .value {font-size:20px;margin-bottom:10px;border-bottom:1px solid lightgray;}', 0, '{\"disable_auto_inline_css\":\"1\"}', '2019-07-29 14:41:11', '2019-12-29 05:21:44');
INSERT INTO `system_mail_partials` (`id`, `name`, `code`, `content_html`, `content_text`, `is_custom`, `created_at`, `updated_at`, `content_html_en`) VALUES
(1, 'Header', 'header', '<tr>\n    <td class=\"header\">\n        {% if url %}\n            <a href=\"{{ url }}\">\n                {{ body }}\n            </a>\n        {% else %}\n            <span>\n                {{ body }}\n            </span>\n        {% endif %}\n    </td>\n</tr>', '*** {{ body|trim }} <{{ url }}>', 0, '2019-07-29 14:23:36', '2019-07-29 14:23:36', NULL),
(2, 'Footer', 'footer', '<div class=\"footer-artwork\" id=\"footer-artwork\">&nbsp;</div>\r\n<div class=\"footer-wrapper\">\r\n  <div class=\"footer-menu\">\r\n    <div class=\"last-update\">\r\n      সাইটটি শেষ হাল-নাগাদ করা হয়েছে:\r\n      <span class=\"date\">২০১৯-০৭-০১ ১৫:৪১:৫২</span>\r\n    </div>\r\n    <div class=\"footer-credit\">\r\n      <p>\r\n        পরিকল্পনা ও বাস্তবায়নে:&nbsp;\r\n        <a href=\"http://www.cabinet.gov.bd/\"  title=\"মন্ত্রিপরিষদ বিভাগ\">মন্ত্রিপরিষদ বিভাগ</a>,&nbsp;\r\n        <a href=\"https://a2i.gov.bd\" title=\"এটুআই\">এটুআই</a>,&nbsp;\r\n        <a href=\"http://www.bcc.net.bd/\" title=\"বিসিসি\">বিসিসি</a>,&nbsp;\r\n        <a href=\"http://doict.gov.bd/\" title=\"ডিওআইসিটি\">ডিওআইসিটি</a>&nbsp;ও&nbsp;\r\n        <a href=\"http://www.basis.org.bd/\" title=\"বেসিস\">বেসিস</a>।\r\n      </p>\r\n      <p>কারিগরি সহায়তায়: <a href=\"https://a2i.gov.bd\" title> <img style=\"height: 28px; vertical-align: baseline; width: 30px\" src=\"http://local.portal.gov.bd/themes/demo/assets/images/a2i.png\"  alt=\"a2i\" /></a></p>\r\n    </div>\r\n  </div>\r\n</div>', '', 1, '2019-07-29 14:23:36', '2019-08-08 20:01:18', '<div class=\"footer-artwork\" id=\"footer-artwork\">&nbsp;</div>\r\n<div class=\"footer-wrapper\">\r\n  <div class=\"footer-menu\">\r\n    <div class=\"last-update\">\r\n      সাইটটি শেষ হাল-নাগাদ করা হয়েছে:\r\n      <span class=\"date\">২০১৯-০৭-০১ ১৫:৪১:৫২</span>\r\n    </div>\r\n    <div class=\"footer-credit\">\r\n      <p>\r\n        পরিকল্পনা ও বাস্তবায়নে:&nbsp;\r\n        <a href=\"http://www.cabinet.gov.bd/\"  title=\"মন্ত্রিপরিষদ বিভাগ\">মন্ত্রিপরিষদ বিভাগ</a>,&nbsp;\r\n        <a href=\"https://a2i.gov.bd\" title=\"এটুআই\">এটুআই</a>,&nbsp;\r\n        <a href=\"http://www.bcc.net.bd/\" title=\"বিসিসি\">বিসিসি</a>,&nbsp;\r\n        <a href=\"http://doict.gov.bd/\" title=\"ডিওআইসিটি\">ডিওআইসিটি</a>&nbsp;ও&nbsp;\r\n        <a href=\"http://www.basis.org.bd/\" title=\"বেসিস\">বেসিস</a>।\r\n      </p>\r\n      <p>কারিগরি সহায়তায়: <a href=\"https://a2i.gov.bd\" title> <img style=\"height: 28px; vertical-align: baseline; width: 30px\" src=\"http://local.portal.gov.bd/themes/demo/assets/images/a2i.png\"  alt=\"a2i\" /></a></p>\r\n    </div>\r\n  </div>\r\n</div>'),
(3, 'Button', 'button', '<table class=\"action\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n    <tr>\r\n        <td align=\"center\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n                <tr>\r\n                    <td align=\"center\">\r\n                        <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n                            <tr>\r\n                                <td>\r\n                                    <a href=\"{{ url }}\" class=\"button button-{{ type ?: \'primary\' }}\" target=\"_blank\">\r\n                                        {{ body }}\r\n                                    </a>\r\n                                    button\r\n                                </td>\r\n                            </tr>\r\n                        </table>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n</table>', '{{ body|trim }} <{{ url }}>', 1, '2019-07-29 14:23:36', '2019-08-01 21:13:48', NULL),
(4, 'Panel', 'panel', '<table class=\"panel\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\n    <tr>\n        <td class=\"panel-content\">\n            <table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\n                <tr>\n                    <td class=\"panel-item\">\n                        {{ body|md_safe }}\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n</table>', '{{ body|trim }}', 0, '2019-07-29 14:23:36', '2019-07-29 14:23:36', NULL),
(5, 'Table', 'table', '<div class=\"table\">\n    {{ body|md_safe }}\n</div>', '{{ body|trim }}', 0, '2019-07-29 14:23:37', '2019-07-29 14:23:37', NULL),
(6, 'Subcopy', 'subcopy', '<table class=\"subcopy\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\n    <tr>\n        <td>\n            {{ body|md_safe }}\n        </td>\n    </tr>\n</table>', '-----\n{{ body|trim }}', 0, '2019-07-29 14:23:37', '2019-07-29 14:23:37', NULL),
(7, 'Promotion', 'promotion', '<table class=\"promotion\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\n    <tr>\n        <td align=\"center\">\n            {{ body|md_safe }}\n        </td>\n    </tr>\n</table>', '{{ body|trim }}', 0, '2019-07-29 14:23:37', '2019-07-29 14:23:37', NULL),
(9, 'Site Right Blocks', 'site-right-blocks', '<div class=\"blocks\">\r\n    {% for block in items %}\r\n        \r\n        {% if (block.type == 2) %}\r\n            \r\n            {% partial \'block-static-html\' domain=domain lang=lang block=block body%}\r\n            {% endpartial %}\r\n            \r\n        {% elseif (block.type == 1) %}\r\n            \r\n            {% partial block.partial_code domain=domain lang=lang body%}\r\n            {% endpartial %}\r\n        \r\n        {% endif %}\r\n        \r\n    {% endfor %}\r\n</div>', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\SiteBlocks\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"status\",1]\r\n                            },\r\n                           {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"region\",\"right\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"sort_order\",\"asc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-08-04 11:53:35', '2019-08-30 13:41:35', '<div class=\"blocks\">\r\n    {% for block in items %}\r\n        \r\n        {% if (block.type == 2) %}\r\n            \r\n            {% partial \'block-static-html\' domain=domain lang=lang block=block body%}\r\n            {% endpartial %}\r\n            \r\n        {% elseif (block.type == 1) %}\r\n            \r\n            {% partial block.partial_code domain=domain lang=lang body%}\r\n            {% endpartial %}\r\n        \r\n        {% endif %}\r\n        \r\n    {% endfor %}\r\n</div>'),
(12, 'block-noticeboard-default', 'block-noticeboard-default', '<div id=\"notice-board\" class=\"box p-4\">\r\n   <div class=\"notice-board-bg\">\r\n       <h2><i class=\"fas fa-chalkboard-teacher fa-4x\"></i> নোটিশ বোর্ড</h2>\r\n       <hr>\r\n      <div id=\"notice-board-ticker\">\r\n         <ul class=\"list list-unstyled\">\r\n         {% for item in items %}\r\n            <li>\r\n                <a href=\"{{lang}}/site/notices/{{item.slug}}\" title=\"{{item.title}}\">\r\n                <i class=\"text-green fa fa-arrow-circle-right\"></i> {{item.title}}\r\n                </a>\r\n                </li>\r\n         {% endfor %}\r\n         </ul>\r\n         <a href=\"http://{{domain}}/bn/site/view/notices\" title=\"সকল\" class=\"btn right\">সকল</a>\r\n      </div>\r\n   </div>\r\n</div>', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\Notices\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"publish\",1]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"publish_date\",\"desc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"take\",\r\n                                \"params\":[\"5\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-08-04 23:47:22', '2019-12-10 00:07:55', '<div id=\"notice-board\">\r\n   <div class=\"notice-board-bg\">\r\n      <h2>Notice Board</h2>\r\n      <div id=\"notice-board-ticker\">\r\n         <ul>\r\n         {% for item in items %}\r\n            <li><a href=\"{{lang}}/site/notices/{{item.slug}}\" title=\"{{item.title}}\">{{item.lang(\'en\').title}}</a></li>\r\n         {% endfor %}\r\n         </ul>\r\n         <a href=\"http://{{domain}}/en/site/view/notices\" title=\"All\" class=\"btn right\">All</a>\r\n      </div>\r\n   </div>\r\n</div>\r\n<style>\r\n    #notice-board {\r\n      border: 1px solid #dddddd;\r\n      font-size: 1em;\r\n      padding: 0 0 10px 0;\r\n      margin-bottom: 20px;\r\n      background: linear-gradient(to bottom, #ffffff 0%, #ebebeb 100%);\r\n    }\r\n    \r\n    .notice-board-bg {\r\n        background: url(\"http://50.28.10.160/cdn/np/images/welcome_grad.png\") repeat-x scroll left top transparent;\r\n        background-image: url(\"http://50.28.10.160/cdn/np/images/bg_notice_board.png\");\r\n        background-repeat: no-repeat;\r\n        padding: 10px 0 20px 100px;\r\n    }\r\n    \r\n    #notice-board h2 {\r\n        font-size: 1.5em;\r\n    }\r\n    \r\n    #notice-board-ticker {\r\n        padding-right: 10px;\r\n    }\r\n    \r\n    #notice-board ul a {\r\n        text-decoration: none;\r\n        font-size: 16px;\r\n        border-bottom: 0;\r\n        margin-left: 20px;\r\n    }\r\n    \r\n    #notice-board-ticker ul li {\r\n        list-style: none;\r\n    }\r\n    \r\n    #notice-board-ticker li {\r\n        margin-bottom: 5px;\r\n        background: url(\"http://50.28.10.160/cdn/np/images/bullet_tick.png\") no-repeat center left;\r\n    }\r\n    \r\n    #notice-board ul a:hover {\r\n        text-decoration: none !important;\r\n        border-bottom: 1px solid #666;\r\n    }\r\n    \r\n    #notice-board-ticker .btn, #news-ticker .btn {\r\n        color: #fff;\r\n    }\r\n</style>\r\n  {{ body }}'),
(14, 'block-static-html', 'block-static-html', '<div class=\"block\">\r\n    \r\n    {% if(block.title) %}\r\n        <h3 class=\"title\">{{block.title}}</h3>\r\n    {% endif %}\r\n    \r\n    <div class=\"content\">\r\n        {{block.body|raw}}\r\n    </div> \r\n</div>', '', 1, '2019-08-05 12:26:43', '2019-08-06 02:38:11', NULL),
