(20, 'block-footer-default', 'block-footer-default', '<div class=\"footer-artwork\" id=\"footer-artwork\">&nbsp;</div>\r\n<div class=\"footer-wrapper\">\r\n  <div class=\"footer-menu\">\r\n    <div class=\"last-update\">\r\n      সাইটটি শেষ হাল-নাগাদ করা হয়েছে:\r\n      <span class=\"date\">২০১৯-০৭-০১ ১৫:৪১:৫২</span>\r\n    </div>\r\n    <div class=\"footer-credit\">\r\n      <p>\r\n        পরিকল্পনা ও বাস্তবায়নে:&nbsp;\r\n        <a href=\"http://www.cabinet.gov.bd/\"  title=\"মন্ত্রিপরিষদ বিভাগ\">মন্ত্রিপরিষদ বিভাগ</a>,&nbsp;\r\n        <a href=\"https://a2i.gov.bd\" title=\"এটুআই\">এটুআই</a>,&nbsp;\r\n        <a href=\"http://www.bcc.net.bd/\" title=\"বিসিসি\">বিসিসি</a>,&nbsp;\r\n        <a href=\"http://doict.gov.bd/\" title=\"ডিওআইসিটি\">ডিওআইসিটি</a>&nbsp;ও&nbsp;\r\n        <a href=\"http://www.basis.org.bd/\" title=\"বেসিস\">বেসিস</a>।\r\n      </p>\r\n      <p>কারিগরি সহায়তায়: <a href=\"https://a2i.gov.bd\" title> <img style=\"height: 28px; vertical-align: baseline; width: 30px\" src=\"{{base_cdn_url}}/images/a2i.png\"  alt=\"a2i\" /></a></p>\r\n    </div>\r\n  </div>\r\n</div>', '', 1, '2019-08-06 00:52:09', '2019-08-09 01:21:38', ''),
(21, 'block-news-default', 'block-news-default', '<div id=\"news\" class=\"section-title\">\r\n   <h5>খবর:</h5>\r\n     <div class=\"news-container\">\r\n         <div id=\"news-ticker\" class=\"ticker\">\r\n             <ul>\r\n                 {% for item in items %}\r\n                    <li><a href=\"{{lang}}/site/news/{{item.slug}}\" title=\"{{item.title}}\">{{item.title}}</a></li>\r\n                 {% endfor %}\r\n             </ul>\r\n         </div>\r\n     </div>\r\n   <div><a href=\"http://{{domain}}/{{lang}}/site/view/news\" title=\"সকল\" class=\"btn\">সকল</a></div>\r\n</div>\r\n<style>\r\n.section-title {\r\n  background-color: #efefef;\r\n  border: 1px solid #cccccc;\r\n  margin: 20px 0;\r\n  padding: 7px 10px;\r\n  display: flex;\r\n  align-items: center;\r\n  justify-content: space-between;\r\n}\r\n.section-title h5 {\r\n  float: left;\r\n  margin: -3px 5px 0 0;\r\n  font-weight: bold;\r\n}\r\n\r\n.section-title #news-ticker {\r\n  overflow: hidden;\r\n  position: relative;\r\n  height: 0px;\r\n}\r\n\r\n.section-title #news-ticker ul {\r\n  position: absolute;\r\n  margin: 0px;\r\n  padding: 0px;\r\n  width: 95%;\r\n}\r\n.news-container {\r\n flex: 1;\r\n}\r\n.news-container li {\r\n list-style: none;\r\n}\r\n</style>\r\n {{ body }}', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\News\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"publish\",1]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"publish_date\",\"desc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-08-06 01:03:52', '2019-09-12 14:17:06', '<div id=\"news\" class=\"section-title\">\r\n   <h5>News:</h5>\r\n     <div class=\"news-container\">\r\n         <div id=\"news-ticker\" class=\"ticker\">\r\n             <ul>\r\n                 {% for item in items %}\r\n                    <li><a href=\"{{lang}}/site/news/{{item.slug}}\" title=\"{{item.lang(\'en\').title}}\">{{item.lang(\'en\').title}}</a></li>\r\n                 {% endfor %}\r\n             </ul>\r\n         </div>\r\n     </div>\r\n   <div><a href=\"http://{{domain}}/{{lang}}/site/view/news\" title=\"All\" class=\"btn\">All</a></div>\r\n</div>\r\n<style>\r\n.section-title {\r\n  background-color: #efefef;\r\n  border: 1px solid #cccccc;\r\n  margin: 20px 0;\r\n  padding: 7px 10px;\r\n  display: flex;\r\n  align-items: center;\r\n  justify-content: space-between;\r\n}\r\n.section-title h5 {\r\n  float: left;\r\n  margin: -3px 5px 0 0;\r\n  font-weight: bold;\r\n}\r\n\r\n.section-title #news-ticker {\r\n  overflow: hidden;\r\n  position: relative;\r\n  height: 0px;\r\n}\r\n\r\n.section-title #news-ticker ul {\r\n  position: absolute;\r\n  margin: 0px;\r\n  padding: 0px;\r\n  width: 95%;\r\n}\r\n.news-container {\r\n flex: 1;\r\n}\r\n.news-container li {\r\n list-style: none;\r\n}\r\n</style>\r\n {{ body }}'),
(22, 'site-flash-blocks', 'site-flash-blocks', '<div class=\"blocks\">\r\n    {% for block in items %}\r\n        \r\n        {% if (block.body) %}\r\n            \r\n            {% partial \'block-static-html\' lang=lang block=block body%}\r\n            {% endpartial %}\r\n            \r\n        {% elseif (block.partial_code) %}\r\n            \r\n            {% partial block.partial_code lang=lang body%}\r\n            {% endpartial %}\r\n        \r\n        {% endif %}\r\n        \r\n    {% endfor %}\r\n</div>', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Structure\\Models\\Block\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"status\",1]\r\n                            },\r\n                           {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"type\",1]\r\n                            },\r\n                           {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"region\",\"flash\"]\r\n                            },\r\n                          \r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"sort_order\",\"asc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-08-06 01:27:39', '2019-08-06 02:28:31', NULL),
(24, 'control-image', 'control-image', '<img src=\"{{src}}\" width=\"{{ width?:\'\'}}\" height=\"{{ height?:\'\'}}\" alt=\"{{alt?:\'\'}}\">', '', 1, '2019-08-06 06:14:16', '2019-12-01 04:26:41', '<img src=\"{{src}}\" width=\"{{ width?:\'\'}}\" height=\"{{ height?:\'\'}}\" alt=\"{{alt?:\'\'}}\">'),
(25, 'control-pdfviewer', 'control-pdfviewer', '{% for v in data %}\r\n    {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension display_file_name=true body%}\r\n    {% endpartial %}    \r\n    <iframe width=\"100%\" height=\"600\" src=\"{{v.path}}\"></iframe>\r\n{% endfor %}\r\n{% if(data.path) %}\r\n    {% partial \'control-file\' name=data.file_name path=data.path ext=data.extension display_file_name=true body%}\r\n    {% endpartial %}\r\n    <iframe width=\"100%\" height=\"600\" src=\"{{data.path}}\"></iframe>\r\n{% endif %}', '', 1, '2019-08-06 06:30:09', '2019-08-30 12:56:26', '{% for v in data %}\r\n    {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension display_file_name=true body%}\r\n    {% endpartial %}    \r\n    <iframe width=\"100%\" height=\"600\" src=\"{{v.path}}\"></iframe>\r\n{% endfor %}\r\n{% if(data.path) %}\r\n    {% partial \'control-file\' name=data.file_name path=data.path ext=data.extension display_file_name=true body%}\r\n    {% endpartial %}\r\n    <iframe width=\"100%\" height=\"600\" src=\"{{data.path}}\"></iframe>\r\n{% endif %}'),
(26, 'block-imagead-default', 'block-imagead-default', '<div class=\"column block static_img_add\">\r\n   <div class=\"content\">\r\n      <a style=\"margin-bottom:5px; display: inline-block;\" href=\"http://{{domain}}/{{lang}}/site/view/district_branding\" alt=\"জেলা ব্র্যান্ডিং\" title=\"\">\r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/d2712647_cde4_4e80_afdc_a1ab27bcd2bd/Tamplate_DistrictBranding_b (3).png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n        </a><br>\r\n      <a style=\"margin-bottom:5px;    display: inline-block;\" href=\"http://{{domain}}/{{lang}}/site/view/spsdata\" alt=\"সেবা সহজিকরন\" title=\" \"> \r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/17dd9bb7_0856_4824_897e_6136ac6ca9b2/Tamplate_sps_bn.png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n      </a><br>\r\n      <a href=\"http://online.forms.gov.bd\" alt=\"ই-সেবার আবেদন\" title=\" \"> \r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/6b8058ef_c17d_4a2d_9b26_b4779731503b/Tamplate_eservice_bn%20(1).png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n      </a>\r\n   </div>\r\n</div>', '', 1, '2019-08-08 21:18:27', '2019-09-13 12:28:27', '<div class=\"column block static_img_add\">\r\n   <div class=\"content\">\r\n      <a style=\"margin-bottom:5px; display: inline-block;\" href=\"http://{{domain}}/{{lang}}/site/view/district_branding\" alt=\"District Branding\" title=\"\">\r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/d2712647_cde4_4e80_afdc_a1ab27bcd2bd/Tamplate_DistrictBranding_b (3).png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n        </a><br>\r\n      <a style=\"margin-bottom:5px;    display: inline-block;\" href=\"http:////{{domain}}/{{lang}}/site/view/spsdata\" alt=\"সেবা সহজিকরন\" title=\" \"> \r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/17dd9bb7_0856_4824_897e_6136ac6ca9b2/Tamplate_sps_bn.png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n      </a><br>\r\n      <a href=\"http://online.forms.gov.bd\" alt=\"Eservices Application\" title=\" \"> \r\n          <img src=\"http://bangladesh.gov.bd/sites/default/files/files/bangladesh.gov.bd/graphical_result_button/6b8058ef_c17d_4a2d_9b26_b4779731503b/Tamplate_eservice_bn%20(1).png\" width=\"100%\" height=\"45px;\" alt=\"\">\r\n      </a>\r\n   </div>\r\n</div>');
INSERT INTO `system_mail_partials` (`id`, `name`, `code`, `content_html`, `content_text`, `is_custom`, `created_at`, `updated_at`, `content_html_en`) VALUES
(27, 'block-job-default', 'block-job-default', '<div class=\"block job-block\">\r\n    <div class=\"content\">\r\n        <table style=\"width:100%;table-layout:fixed;padding:0px;\">\r\n           <tbody>\r\n              <tr style=\"border-bottom: 3px solid #f2f2f2\">\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_job\" title=\"চাকুরি\"><span>চাকুরি <sup>({{ items.job_count }})</sup></span></a></td>\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_tender\" title=\"টেন্ডার\"><span>টেন্ডার <sup>({{ items.tender_count }})</sup></span></a></td>\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_advertisement\" title=\"বিজ্ঞাপন\"><span>বিজ্ঞাপন <sup>({{ items.ad_count }})</sup></span></a></td>\r\n              </tr>\r\n           </tbody>\r\n        </table>\r\n        {% if (items and items.ads) %}\r\n            <div id=\"ad-slider\">\r\n                {% for ad in items.ads %}\r\n                    <div class=\"ad-slide-item\">\r\n                        <a href=\"{{ad.image.path}}\">\r\n                            <img src={{ad.image.path}} />\r\n                        </a>\r\n                    </div>\r\n                {% endfor %}\r\n            </div>\r\n            <div style=\"clear:both\"></div>\r\n        {% endif %}\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n#ad-slider .ad-slide-item {\r\n    width: 100%;\r\n    display: none;\r\n}\r\n\r\n#ad-slider .ad-slide-item:first-child {\r\n    display: block;\r\n}\r\n\r\n</style>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\RevenueModelAdvertisement\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"getJobTenderAdData\"\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-08-08 21:23:11', '2019-09-05 12:27:19', '<div class=\"block job-block\">\r\n    <div class=\"content\">\r\n        <table style=\"width:100%;table-layout:fixed;padding:0px;\">\r\n           <tbody>\r\n              <tr style=\"border-bottom: 3px solid #f2f2f2\">\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_job\" title=\"Job Corner\"><span>Job Corner <sup>({{ items.job_count }})</sup></span></a></td>\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_tender\" title=\"Tender\"><span>Tender <sup>({{ items.tender_count }})</sup></span></a></td>\r\n                 <td class=\"apply-online\"><a href=\"http://{{domain}}/{{lang}}/site/view/revenue_model_advertisement\" title=\"Advertisement\"><span>Advertisement <sup>({{ items.ad_count }})</sup></span></a></td>\r\n              </tr>\r\n           </tbody>\r\n        </table>\r\n        {% if (items and items.ads) %}\r\n            <div id=\"ad-slider\">\r\n                {% for ad in items.ads %}\r\n                    <div class=\"ad-slide-item\">\r\n                        <a href=\"{{ad.image.path}}\">\r\n                            <img src={{ad.image.path}} />\r\n                        </a>\r\n                    </div>\r\n                {% endfor %}\r\n            </div>\r\n            <div style=\"clear:both\"></div>\r\n        {% endif %}\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n#ad-slider .ad-slide-item {\r\n    width: 100%;\r\n    display: none;\r\n}\r\n\r\n#ad-slider .ad-slide-item:first-child {\r\n    display: block;\r\n}\r\n\r\n</style>'),
(28, 'block-anthem-default', 'block-anthem-default', '<div class=\"block\">\r\n   <h5 class=\"title\">জাতীয় সংগীত</h5>\r\n   <div class=\"content\">\r\n      <audio controls=\"\" style=\"width:100%\">\r\n         <source src=\"https://cabinet.portal.gov.bd/sites/default/files/files/cabinet.portal.gov.bd/page/e5f25d4e_f0a7_4b2a_a07c_3ec69a793516/bd_national_anthem.mp3\" type=\"audio/mp3\">\r\n      </audio>\r\n   </div>\r\n</div>', '', 1, '2019-08-08 21:33:27', '2019-08-09 00:55:31', ''),
(29, 'block-map-default', 'block-map-default', '<div class=\"block\">\r\n   <h5 class=\"title\">ভিডিও ও ম্যাপ</h5>\r\n   <div class=\"content\">\r\n      <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n         <tbody>\r\n            <tr>\r\n               <td><iframe frameborder=\"0\" height=\"250\" src=\"https://www.youtube.com/embed/b_r0AQCDndI\" width=\"300\"></iframe></td>\r\n               <td><iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242.31713895127177!2d91.86923511005512!3d24.89099194359659!2m3!1f270!2f0!3f0!3m2!1i1024!2i768!4f35!3m3!1m2!1s0x3751aad53ad3b351%3A0x7841f29ab820c95e!2sSylhet+DC+office!5e1!3m2!1sbn!2sbd!4v1508321902123\" width=\"415\" height=\"250\" frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe></td>\r\n            </tr>\r\n         </tbody>\r\n      </table>\r\n   </div>\r\n</div>', '', 1, '2019-08-08 21:42:23', '2019-09-12 14:15:18', '<div class=\"block\">\r\n   <h5 class=\"title\">Video and Map</h5>\r\n   <div class=\"content\">\r\n      <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n         <tbody>\r\n            <tr>\r\n               <td><iframe frameborder=\"0\" height=\"250\" src=\"https://www.youtube.com/embed/b_r0AQCDndI\" width=\"300\"></iframe></td>\r\n               <td><iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242.31713895127177!2d91.86923511005512!3d24.89099194359659!2m3!1f270!2f0!3f0!3m2!1i1024!2i768!4f35!3m3!1m2!1s0x3751aad53ad3b351%3A0x7841f29ab820c95e!2sSylhet+DC+office!5e1!3m2!1sbn!2sbd!4v1508321902123\" width=\"415\" height=\"250\" frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe></td>\r\n            </tr>\r\n         </tbody>\r\n      </table>\r\n   </div>\r\n</div>'),
(30, 'block-centraleservice-default', 'block-centraleservice-default', '<div class=\"block service-list\">\r\n   <a href=\"https://bangladesh.gov.bd/site/view/all_eservices_in_bangladesh/\">\r\n       <h5 class=\"bk-org title eservice-title ces_title\">কেন্দ্রীয় ই-সেবা</h5>\r\n   </a>\r\n   <div class=\"content\">\r\n   </div>\r\n</div>', '', 1, '2019-08-09 06:18:09', '2019-09-12 14:08:04', '<div class=\"block service-list\">\r\n   <a href=\"https://bangladesh.gov.bd/site/view/all_eservices_in_bangladesh/\">\r\n       <h5 class=\"bk-org title eservice-title ces_title\">Central Eservices</h5>\r\n   </a>\r\n   <div class=\"content\">\r\n   </div>\r\n</div>'),
(31, 'block-internaleservices-default', 'block-internaleservices-default', '<div class=\"block service-list\">\r\n   <h5 class=\"bk-org title eservice-title ces_title\">অভ্যন্তরীণ ই-সেবা</h5>\r\n    <ul>\r\n    {% for item in items %}\r\n        <li>\r\n           \r\n           <a href=\"{{ generate_link(item.link.link,lang) }}\" title=\"{{item.title}}\">\r\n           <i class=\" text-green fa fa-check-circle\" aria-hidden=\"true\"></i> {{item.title}}\r\n           </a>\r\n        </li>\r\n    {% endfor %}\r\n    </ul>\r\n</div>', '{\r\n                     \"items\":{\r\n                        \"class\":\"Np\\Contents\\Models\\InternalEservices\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }                            \r\n                        ]\r\n                     }\r\n}', 1, '2019-08-09 06:21:14', '2019-12-01 01:39:16', '<div class=\"block service-list\">\r\n   <h5 class=\"bk-org title eservice-title ces_title\">Internal Eservices</h5>\r\n    <ul>\r\n    {% for item in items %}\r\n       <li>\r\n           \r\n           <a href=\"{{ generate_link(item.link.link,lang) }}\" title=\"{{item.title}}\">\r\n           <i class=\" text-green fa fa-check-circle\" aria-hidden=\"true\"></i> {{item.title}}\r\n           </a>\r\n        </li>\r\n        \r\n    {% endfor %}\r\n    </ul>\r\n</div>'),
(32, 'block-hotline-default', 'block-hotline-default', '<div class=\"block\">\r\n   <h5 class=\"title\">জরুরি হটলাইন</h5>\r\n   <div class=\"content\">\r\n      <img alt=\"জরুরি হটলাইন\" src=\"https://mopa.gov.bd/uploader/server/../../sites/default/files/files/mopa.gov.bd/npfblock//Hotline_BN.png\" style=\"height:100%; width:220px\">\r\n   </div>\r\n</div>', '', 1, '2019-08-09 06:24:30', '2019-08-09 06:24:30', ''),
(33, 'block-serviceboxs-default', 'block-serviceboxs-default', '{% for service in items %}\r\n\r\n\r\n    {% if (loop.index % 2 != 0) %}\r\n        <div class=\"row service-row\">\r\n    {% endif %}\r\n       <div class=\"col-md-6\">\r\n          <div class=\"service-box box\">\r\n            <h4 style=\"color: {{service.title_color}}\">{{ service.title }}</h4>\r\n             <img src=\"{{service.image[0].path}}\" alt=\"{{service.title}}\" width=\"110\" style=\"max-width:700px;\">\r\n             <ul class=\"caption fade-caption\" style=\"margin:0\">\r\n                 <!-- {{service.link1|json_encode(constant(\'JSON_PRETTY_PRINT\'))}} -->\r\n                <li>\r\n                    <i class=\"text-green fa fa-caret-right\"></i>\r\n                    <a href=\"{{generate_link(service.link1.link,lang)}}\" title=\"{{service.link1.caption[lang]}}\"> {{service.link1.caption[lang]}}</a>\r\n                </li>\r\n                <li><i class=\"text-green fa fa-caret-right\"></i><a href=\"{{generate_link(service.link2.link,lang)}}\" title=\"{{service.link2.caption[lang]}}\">{{service.link2.caption[lang]}}</a></li>\r\n                <li><i class=\"text-green fa fa-caret-right\"></i><a href=\"{{generate_link(service.link3.link,lang)}}\" title=\"{{service.link3.caption[lang]}}\">{{service.link3.caption[lang]}}</a></li>\r\n                <li><i class=\"text-green fa fa-caret-right\"></i><a href=\"{{generate_link(service.link4.link,lang)}}\" title=\"{{service.link4.caption[lang]}}\">{{service.link4.caption[lang]}}</a></li>\r\n             </ul>\r\n          </div>\r\n       </div>\r\n    {% if (loop.index % 2 == 0 ) %}\r\n        {% set end_tag = \'yes\' %}\r\n        </div>\r\n    {% endif %}\r\n{% endfor %}\r\n{% if (end_tag == \'yes\') %}\r\n    </div>\r\n{% endif %}\r\n\r\n<style>\r\n.service-box {\r\n  background-color: #f5f5f5;\r\n  border: 1px solid #ccc;\r\n  cursor: pointer;\r\n  padding: 10px;\r\n  position: relative;\r\n  overflow: hidden;\r\n  color: #000;\r\n  box-shadow: 1px 1px 1px 1px #ccc;\r\n}\r\n\r\n.service-box h4 {\r\n  font-size: 21px;\r\n  line-height: 30px;\r\n  margin-bottom: 4px;\r\n}\r\n\r\n.service-box img {\r\n  position: relative;\r\n  left: 0;\r\n  max-width: 700px;\r\n  transition: all 300ms ease-out;\r\n  float: left;\r\n}\r\n\r\n.service-box .caption {\r\n  position: relative;\r\n  color: #000;\r\n  z-index: 1;\r\n  transition: all 300ms ease-out;\r\n  left: 0;\r\n  padding: 0;\r\n  float: left;\r\n}\r\n\r\n.service-box .fade-caption {\r\n  max-width: 65%;\r\n}\r\n\r\n.service-box .caption li {\r\n  margin: 2px 0 0 10px;\r\n  list-style:none;\r\n}\r\n\r\n.service-box .caption li i.fa {\r\n  margin-right: 5px;\r\n  \r\n}\r\n\r\n.service-box .caption li a {\r\n    font-size: 15px;\r\n    text-decoration: none;\r\n}\r\n\r\n.service-box .caption li a:hover {\r\n    text-decoration: underline;\r\n}\r\n\r\n</style>', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\FrontServiceBox\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"publish\",1]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"sort_order\",\"asc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-08-09 06:27:39', '2019-12-01 01:45:49', '{% for service in items %}\r\n    {% if (loop.index % 2 != 0) %}\r\n        <div class=\"row service-row\">\r\n    {% endif %}\r\n       <div class=\"col-md-6\">\r\n          <div class=\"service-box box\">\r\n            <h4 style=\"color: {{service.title_color}}\">{{ service.lang(\'en\').title }}</h4>\r\n             <img src=\"{{service.image[0].path}}\" alt=\"{{service.title}}\" width=\"110\" style=\"max-width:700px;\">\r\n             <ul class=\"caption fade-caption\" style=\"margin:0\">\r\n                <li><a title=\"{{service.link1.caption[lang]}}\" href=\"{{ generate_link(service.link1.link,lang)}}\">{{service.link1.caption[lang]}}</a></li>\r\n                <li><a title=\"{{service.link2.caption[lang]}}\" href=\"{{ generate_link(service.link2.link,lang)}}\">{{service.link2.caption[lang]}}</a></li>\r\n                <li><a title=\"{{service.link3.caption[lang]}}\" href=\"{{ generate_link(service.link3.link,lang)}}\">{{service.link3.caption[lang]}}</a></li>\r\n                <li><a title=\"{{service.link4.caption[lang]}}\" href=\"{{ generate_link(service.link4.link,lang)}}\">{{service.link4.caption[lang]}}</a></li>\r\n             </ul>\r\n          </div>\r\n       </div>\r\n    {% if (loop.index % 2 == 0 ) %}\r\n        {% set end_tag = \'yes\' %}\r\n        </div>\r\n    {% endif %}\r\n{% endfor %}\r\n{% if (end_tag == \'yes\') %}\r\n    </div>\r\n{% endif %}\r\n\r\n<style>\r\n.service-box {\r\n  background-color: #f5f5f5;\r\n  border: 1px solid #ccc;\r\n  cursor: pointer;\r\n  padding: 10px;\r\n  position: relative;\r\n  overflow: hidden;\r\n  color: #000;\r\n  box-shadow: 1px 1px 1px 1px #ccc;\r\n}\r\n\r\n.service-box h4 {\r\n  font-size: 21px;\r\n  line-height: 30px;\r\n  margin-bottom: 4px;\r\n}\r\n\r\n.service-box img {\r\n  position: relative;\r\n  left: 0;\r\n  max-width: 700px;\r\n  transition: all 300ms ease-out;\r\n  float: left;\r\n}\r\n\r\n.service-box .caption {\r\n  position: relative;\r\n  color: #000;\r\n  z-index: 1;\r\n  transition: all 300ms ease-out;\r\n  left: 0;\r\n  padding: 0;\r\n  float: left;\r\n}\r\n\r\n.service-box .fade-caption {\r\n  max-width: 65%;\r\n}\r\n\r\n.service-box .caption li {\r\n  margin: 2px 0 0 20px;\r\n  list-style-image: url(\"http://50.28.10.160/cdn/np/images/bullet_tick.png\");\r\n}\r\n\r\n.service-box .caption li a {\r\n    font-size: 15px;\r\n    text-decoration: none;\r\n}\r\n\r\n.service-box .caption li a:hover {\r\n    text-decoration: underline;\r\n}\r\n\r\n</style>'),
(36, 'list-common-default', 'list-common-default', '<h3 class=\"title\">\r\n    {{ list.title }}\r\n    {% if(list.is_archive == true) %}\r\n        আর্কাইভ\r\n    {% endif %}\r\n</h3>\r\n\r\n{% set toolbar = list.toolbar %}\r\n{% if toolbar.search or toolbar.filters or toolbar.layers %}\r\n\r\n \r\n    <div class=\"row\">\r\n        <div class=\"col-md-2\">\r\n            <b>ফিল্টার করুন :</b>\r\n            {% if q.q %}<a href=\"/{{lang}}/site/view/{{_code}}\"><i class=\"fa fa-redo\"></i></a>{% endif %}\r\n        </div>\r\n        \r\n    </div>\r\n\r\n<div class=\"row toolbar\">\r\n   \r\n    {% if toolbar.layers %}\r\n        {% partial \'filter-layers\' q=q listTitle=list.title layers=toolbar.layers body%}\r\n        {% endpartial %}\r\n    {% endif %}\r\n    \r\n     \r\n    {% if toolbar.search %}\r\n        {% partial \'filter-search\' q=q body%}\r\n        {% endpartial %}\r\n    {% endif %}\r\n    \r\n    \r\n    {% if toolbar.filters %}\r\n    \r\n       \r\n       {% for filter in toolbar.filters %}\r\n    \r\n           {% partial \'filter-taxonomy-\'~ filter.type filter=filter q=q body%}\r\n           {% endpartial %}\r\n    \r\n       {% endfor %}\r\n       \r\n    {% endif %}\r\n    \r\n    \r\n</div>\r\n<br>\r\n\r\n{% endif %}\r\n\r\n\r\n<table class=\"table table-bordered\">\r\n  <thead class=\"thead-dark\">\r\n    <tr>\r\n      <th scope=\"col\">#</th>\r\n        {% for c in list.columns %}\r\n            <th scope=\"col {{c.type}}\">{{ c.displayName.bn }}</th>\r\n        {% endfor %}\r\n     \r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    {% for item in list.items %}\r\n        <tr>\r\n          <td scope=\"row sl\">{{item.sl}}</td>\r\n            {% for c in item.row %}\r\n                {% if (c.config.type == \'text\') %}\r\n                    {% if (c.config.link) %}\r\n                        <td class=\"{{c.config.type}}\">\r\n                            {% if c.config.link is same as (true) %}\r\n                                <a href=\"{{details_link(code,lang,c.slug)}}\">{{ c.value }}</a>\r\n                            {% else %}\r\n                                {% set url = generate_link(item.record.link.link,lang) %}\r\n                                <a href=\"{{url}}\">{{ c.value }}ll</a>\r\n                            {% endif %}\r\n                        </td>\r\n                    {% else %}\r\n                        <td class=\"{{c.config.type}}\">{{ c.value }}</td>\r\n                    {% endif %}\r\n               \r\n                {% elseif (c.config.type == \'html_text\') %}\r\n                \r\n                   <td class=\"{{c.config.type}}\">\r\n                        \r\n                       {{c.value|raw}}\r\n                    \r\n                        \r\n                    </td>\r\n                 {% elseif (c.config.type == \'relation\') %}\r\n                \r\n                   <td class=\"{{c.config.type}}\">\r\n                       {% set values = c.value|split(\'$$\') %}    \r\n                       {{ c.config.link ? relation_link(values[0],code,c.config.name,values[2],lang) : values[0] }}\r\n                    \r\n                        \r\n                    </td>\r\n                    \r\n                {% elseif (c.config.type == \'email\') %}\r\n                \r\n                   <td class=\"{{c.config.type}}\">\r\n                        \r\n                       <a href=\"mailto:{{c.value}}\">{{c.value}}</a>\r\n                    \r\n                        \r\n                    </td>\r\n                 {% elseif (c.config.type == \'mobile\') %}\r\n                \r\n                   <td class=\"{{c.config.type}}\">\r\n                        \r\n                       <a href=\"tel:{{c.value}}\">{{c.value}}</a>\r\n                    \r\n                        \r\n                    </td>\r\n                    \r\n                {% elseif (c.config.type == \'image\') %}\r\n                \r\n                   <td class=\"{{c.config.type}}\">\r\n                        \r\n                        {% partial \'control-image\' src=c.value.path width=\"100\" body%}\r\n                        {% endpartial %}\r\n                    \r\n                        \r\n                    </td>\r\n                    \r\n                {% elseif (c.config.type == \'file\') %}\r\n                    <td class=\"{{c.config.type}}\">\r\n                        {% for v in c.value %}\r\n                            {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension body%}\r\n                            {% endpartial %}\r\n                        {% endfor %}\r\n                        \r\n                        \r\n                        {% if(c.value.path) %}\r\n                            {% partial \'control-file\' name=c.value.file_name path=c.value.path ext=c.value.extension body%}\r\n                            {% endpartial %}\r\n                        {% endif %}\r\n                    </td>\r\n                \r\n                {% else %}\r\n                    <td>{{ c.value }}</td>\r\n                {% endif %}\r\n                \r\n                \r\n            {% endfor %}          \r\n        </tr>\r\n    {% endfor %}\r\n  </tbody>\r\n</table>\r\n<div class=\"content-type-footer\">\r\n    <div class=\"left pagination\">\r\n        {{ list.pagination | raw }}\r\n    </div>\r\n    {% if(list.is_archive == true) %}\r\n        <div class=\"right\">\r\n            <a class=\"btn\" href=\"/{{lang}}/site/view/{{_code}}_archive\" title=\"{{list.title}} আর্কাইভ\">{{list.title}} আর্কাইভ</a>\r\n        </div>\r\n    {% endif %}\r\n</div>\r\n\r\n<style>\r\n    .content-type-footer {\r\n        display: flex;\r\n        align-items: center;\r\n    }\r\n    .content-type-footer .right {\r\n        flex: 1;\r\n        display: flex;\r\n        justify-content: flex-end;\r\n    }\r\n</style>', '', 1, '2019-08-26 16:16:35', '2019-12-29 04:45:11', '<h3 class=\"title\">\r\n    {{ list.title }}\r\n    {% if(list.is_archive == true) %}\r\n        Archive\r\n    {% endif %}\r\n</h3>\r\n\r\n{% set toolbar = list.toolbar %}\r\n{% if toolbar.search or toolbar.filters %}\r\n\r\n \r\n    <div class=\"row\">\r\n        <div class=\"col-md-2\">\r\n            <b>Filter :</b>\r\n            {% if q.q %}<a href=\"/{{lang}}/site/view/{{_code}}\"><i class=\"fa fa-redo\"></i></a>{% endif %}\r\n        </div>\r\n        \r\n    </div>\r\n\r\n\r\n\r\n<div class=\"row toolbar\">\r\n    \r\n    {% if toolbar.search %}\r\n        {% partial \'filter-search\' q=q body%}\r\n        {% endpartial %}\r\n    {% endif %}\r\n    \r\n    \r\n    {% if toolbar.filters %}\r\n    \r\n       \r\n       {% for filter in toolbar.filters %}\r\n    \r\n           {% partial \'filter-taxonomy-\'~ filter.type filter=filter q=q body%}\r\n           {% endpartial %}\r\n    \r\n       {% endfor %}\r\n       \r\n    {% endif %}\r\n    \r\n    \r\n</div>\r\n<br>\r\n\r\n{% endif %}\r\n\r\n\r\n<table class=\"table table-bordered content-type-list\">\r\n  <thead class=\"thead-dark\">\r\n    <tr>\r\n      <th scope=\"col\">#</th>\r\n        {% for c in list.columns %}\r\n            <th scope=\"col\">{{ c.displayName.en }}</th>\r\n        {% endfor %}\r\n     \r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    {% for item in list.items %}\r\n        <tr>\r\n          <td scope=\"row\">{{item.sl}}</td>\r\n            {% for c in item.row %}\r\n                {% if (c.config.type == \'text\') %}\r\n                    {% if (c.config.link) %}\r\n                        <td>\r\n                            {% if c.config.link is same as (true) %}\r\n                                <a href=\"/{{lang}}/site/{{_code}}/{{c.slug}}\">{{ c.value }}</a>\r\n                            {% else %}\r\n                                {% set url = generate_link(item.record.link.link,lang) %}\r\n                                <a href=\"{{url}}\">{{ c.value }}ll</a>\r\n                            {% endif %}\r\n                        </td>\r\n                    {% else %}\r\n                        <td>{{ c.value }}</td>\r\n                    {% endif %}\r\n                {% elseif (c.config.type == \'image\') %}\r\n                \r\n                   <td>\r\n                        \r\n                        {% partial \'control-image\' src=c.value.path width=\"100\" body%}\r\n                        {% endpartial %}\r\n                    \r\n                        \r\n                    </td>\r\n                    \r\n                {% elseif (c.config.type == \'file\') %}\r\n                    <td>\r\n                        {% for v in c.value %}\r\n                            {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension body%}\r\n                            {% endpartial %}\r\n                        {% endfor %}\r\n                        \r\n                        \r\n                        {% if(c.value.path) %}\r\n                            {% partial \'control-file\' name=c.value.file_name path=c.value.path ext=c.value.extension body%}\r\n                            {% endpartial %}\r\n                        {% endif %}\r\n                    </td>\r\n                \r\n                {% else %}\r\n                    <td>{{ c.value }}</td>\r\n                {% endif %}\r\n                \r\n                \r\n            {% endfor %}          \r\n        </tr>\r\n    {% endfor %}\r\n  </tbody>\r\n</table>\r\n<div class=\"content-type-footer\">\r\n    <div class=\"left\">\r\n        {{ list.pagination | raw }}\r\n    </div>\r\n    {% if(list.is_archive != true) %}\r\n        <div class=\"right\">\r\n            <a class=\"btn\" href=\"/{{lang}}/site/view/{{_code}}_archive\" title=\"{{list.title}} আর্কাইভ\">{{list.title}} আর্কাইভ</a>\r\n        </div>\r\n    {% endif %}\r\n</div>\r\n\r\n<style>\r\n    .content-type-footer {\r\n        display: flex;\r\n        align-items: center;\r\n    }\r\n    .content-type-footer .right {\r\n        flex: 1;\r\n        display: flex;\r\n        justify-content: flex-end;\r\n    }\r\n</style>'),
(37, 'details-common-default', 'details-common-default', '{% if data %}\r\n\r\n{% if data.title %}\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        <a href=\"{{view_link(code,lang)}}\"><i class=\"fa fa-arrow-left\" aria-hidden=\"true\"></i> <b>{{data.title}}</b></a>    \r\n    </div>\r\n</div>\r\n{% endif %}\r\n\r\n<br>\r\n\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        {% for column in data.config.columns %}\r\n            \r\n            {% set value = attribute(data.item, column.name) %}\r\n            \r\n            {% if value %}\r\n              <div class=\"{{column.type}} {{column.name}}\">\r\n                  \r\n                    <div class=\"label {{ column.name == \'title\' ? \'d-none\':\'\' }}\">{{attribute(column.displayName,lang)}}</div>\r\n                    <div class=\"value\">\r\n                        {% partial \'details-control-\'~column.type value=value name=column.name item=data.item body%}\r\n                        {% endpartial %}\r\n                    </div>\r\n                    \r\n              </div>\r\n            {% endif %}\r\n            \r\n            \r\n        {% endfor %}            \r\n    </div>\r\n</div>\r\n\r\n{% else %}\r\n    <p>No Data Found</p>\r\n{% endif %}', '', 1, '2019-08-26 16:19:57', '2019-12-29 01:27:47', '{% if data %}\r\n\r\n{% if data.title %}\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        <a href=\"{{view_link(code,lang)}}\"><i class=\"fa fa-arrow-left\" aria-hidden=\"true\"></i> <b>{{data.title}}</b></a>    \r\n    </div>\r\n</div>\r\n{% endif %}\r\n\r\n<br>\r\n\r\n<div class=\"row\">\r\n    <div class=\"col\">\r\n        {% for column in data.config.columns %}\r\n            \r\n            {% set value = attribute(data.item, column.name) %}\r\n            \r\n            {% if value %}\r\n              <div class=\"{{column.type}} {{column.name}}\">\r\n                  \r\n                    <div class=\"label {{ column.name == \'title\' ? \'d-none\':\'\' }}\">{{attribute(column.displayName,lang)}}</div>\r\n                    <div class=\"value\">\r\n                        {% partial \'details-control-\'~column.type value=value name=column.name item=data.item body%}\r\n                        {% endpartial %}\r\n                    </div>\r\n                    \r\n              </div>\r\n            {% endif %}\r\n            \r\n            \r\n        {% endfor %}            \r\n    </div>\r\n</div>\r\n\r\n{% else %}\r\n    <p>No Data Found</p>\r\n{% endif %}'),
(38, 'control-file', 'control-file', '<a class=\"control-file\" target=\"_blank\" download={{name}} href=\"{{path}}\" title=\"{{name}}\" >\r\n    {% if(ext == \'pdf\') %}\r\n       <i class=\"fa fa-file-pdf text-danger\"></i>\r\n    {% elseif(ext == \'doc\' or ext == \'docx\') %}\r\n       <i class=\"fa fa-file-word text-primary\"></i>\r\n    {% elseif(ext == \'jpg\' or ext == \'png\' or ext == \'JPG\' or ext == \'PNG\') %}\r\n        <i class=\"fa fa-image text-primary\"></i>\r\n    {% endif %}\r\n    {% if(display_file_name) %}\r\n        {{ name }}\r\n    {% endif %}\r\n</a>', '', 1, '2019-08-30 09:21:36', '2019-12-03 00:42:37', '<a class=\"control-file\" target=\"_blank\" download={{name}} href=\"{{path}}\" title=\"{{name}}\" >\r\n    {% if(ext == \'pdf\') %}\r\n        <img src=\"http://50.28.10.160/cdn/np/images/files/pdf.png\" />\r\n    {% elseif(ext == \'doc\' or ext == \'docx\') %}\r\n        <img src=\"http://50.28.10.160/cdn/np/images/files/pdf.png\" />\r\n    {% elseif(ext == \'jpg\' or ext == \'png\') %}\r\n        <img src=\"http://50.28.10.160/cdn/np/images/files/png.png\" />\r\n    {% endif %}\r\n    {% if(display_file_name) %}\r\n        {{ name }}\r\n    {% endif %}\r\n</a>'),
(39, 'block-innovationcorner-default', 'block-innovationcorner-default', '<div class=\"block service-list\">   \r\n   <a href=\"http://{{domain}}/{{lang}}/site/view/innovation_content\">\r\n       <h5 class=\"bk-org title eservice-title ces_title\">ইনোভেশন কর্নার</h5>\r\n   </a>\r\n   <div class=\"content\">\r\n   </div>\r\n</div>', '', 1, '2019-08-30 13:09:14', '2019-08-31 14:32:56', '<div class=\"block service-list\">\r\n   <a href=\"http://{{domain}}/{{lang}}/site/view/innovation_content\">\r\n       <h5 class=\"bk-org title eservice-title ces_title\">Innovation Corner</h5>\r\n   </a>\r\n   <div class=\"content\">\r\n   </div>\r\n</div>'),
(42, 'list-innovation_content-default', 'list-innovation_content-default', '{% for item in items %}\r\n    {% for i in item %}\r\n        {% if(loop.index == 1) %}\r\n            <h1>{{i.innovation_content_category_taxonomy.name}}</h1>\r\n        {% endif %}\r\n            <p><a href=\"http://{{domain}}/{{lang}}/site/{{_code}}/{{i.slug}}\">{{ loop.index }}. {{ i.title }}</a></p>\r\n    {% endfor %}\r\n{% endfor %}', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Structure\\Classes\\NP\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"gets\",\r\n        \"params\": [\"InnovationContent\", \"innovation_content_category_taxonomy\"]\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-08-31 14:35:02', '2019-09-08 11:48:41', '{% for item in items %}\r\n    {% for i in item %}\r\n        {% if(loop.index == 1) %}\r\n            <h1>{{i.innovation_content_category_taxonomy.name}}</h1>\r\n        {% endif %}\r\n            <p><a href=\"http://{{domain}}/{{lang}}/site/{{_code}}/{{i.slug}}\">{{ loop.index }}. {{ i.title }}</a></p>\r\n    {% endfor %}\r\n{% endfor %}'),
(79, 'block-socialmediacorner-default', 'block-socialmediacorner-default', '<div class=\"block service-list\">   \r\n   <h5 class=\"bk-org title eservice-title ces_title\">সামাজিক যোগাযোগ মাধ্যম</h5>\r\n   <div class=\"content\">\r\n   \r\n       {% for item in items %}\r\n       \r\n        <a title=\"{{item.social_link_taxonomy.name}}\" href=\"{{item.field_social_media_url}}\" target=\"_blank\" class=\"share-buttons\"> \r\n           \r\n           <i class=\"fa fa-{{item.social_link_taxonomy.name}}-square fa-3x p-1 text-primary\"></i>\r\n\r\n        </a>\r\n       {% endfor %}\r\n   </div>\r\n</div>\r\n<div style=\"clear: both\"></div>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\SocialMediaCorner\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"where\",\r\n        \"params\": [\"publish\", 1]\r\n      },\r\n      {\r\n        \"name\": \"orderBy\",\r\n        \"params\": [\"publish_date\", \"desc\"]\r\n      },\r\n      {\r\n        \"name\": \"get\"\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-09-09 05:04:26', '2019-11-19 04:52:00', '<div class=\"block service-list\">   \r\n   <h5 class=\"bk-org title eservice-title ces_title\">Social Media Corner</h5>\r\n   <div class=\"content\">\r\n       {% for item in items %}\r\n        <a title=\"{{item.social_link_taxonomy.name}}\" href=\"{{item.field_social_media_url}}\" target=\"_blank\" class=\"share-buttons\"> \r\n        	<img width=\"30px\" src=\"http://50.28.10.160/cdn/np/images/social/{{item.social_link_taxonomy.name}}.png\" alt=\"{{item.social_link_taxonomy.name}}\">\r\n        </a>\r\n       {% endfor %}\r\n   </div>\r\n</div>'),
(83, 'block-importantlinks-default', 'block-importantlinks-default', '<div class=\"block service-list\">\r\n   <h5 class=\"bk-org title eservice-title ces_title\">গুরুত্বপূর্ণ লিংক</h5>\r\n    <ul>\r\n    {% for item in items %}\r\n        <li><a href=\"{{item.link.link}}\" title=\"{{item.title}}\">{{item.title}}</a></li>\r\n    {% endfor %}\r\n    </ul>\r\n</div>', '{\r\n                     \"items\":{\r\n                        \"class\":\"Np\\Contents\\Models\\ExternalLinks\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }                            \r\n                        ]\r\n                     }\r\n}', 1, '2019-09-12 00:06:48', '2019-09-16 05:45:50', '<div class=\"block service-list\">\r\n   <h5 class=\"bk-org title eservice-title ces_title\">Important Links</h5>\r\n    <ul>\r\n    {% for item in items %}\r\n        <li><a href=\"{{item.link.link}}\" title=\"{{item.lang(\'en\').title}}\">{{item.lang(\'en\').title}}</a></li>\r\n    {% endfor %}\r\n    </ul>\r\n</div>'),
(84, 'details-district_branding-default', 'details-district_branding-default', '<div class=\"district_branding\">\r\n   \r\n   <div class=\"image\">\r\n      <img style=\"max-width:700px;\" src=\"{{items.image.path}}\" width=\"150\" height=\"150\" />               \r\n      <p>{{items.slogan}}</p>\r\n   </div>\r\n   \r\n   <h4>{{items.title}}</h4>\r\n   \r\n   {% if(items.images) %}    \r\n   <div id=\"carouselExampleIndicators\" class=\"carousel slide\" data-ride=\"carousel\">\r\n      <div class=\"carousel-inner\">\r\n         {% for img in items.images %}\r\n             {% if(loop.index == 1) %}                \r\n             <div class=\"carousel-item active\">\r\n                 <img class=\"d-block w-100\" src=\"{{img.path}}\">\r\n             </div>\r\n             {% else %}                \r\n                 <div class=\"carousel-item\">\r\n                     <img class=\"d-block w-100\" src=\"{{img.path}}\">\r\n                 </div>\r\n             {% endif %}\r\n         {% endfor %}      \r\n      </div>\r\n      <a class=\"carousel-control-prev\" href=\"#carouselExampleIndicators\" role=\"button\" data-slide=\"prev\">\r\n          <span class=\"carousel-control-prev-icon\" aria-hidden=\"true\"></span>\r\n          <span class=\"sr-only\">Previous</span>\r\n      </a>\r\n      <a class=\"carousel-control-next\" href=\"#carouselExampleIndicators\" role=\"button\" data-slide=\"next\">\r\n          <span class=\"carousel-control-next-icon\" aria-hidden=\"true\"></span>\r\n          <span class=\"sr-only\">Next</span>\r\n      </a>    \r\n   </div>\r\n   {% endif %}        \r\n   <div>\r\n      <h4>বিস্তারিত</h4>\r\n      {{items.body | raw}}    \r\n   </div>\r\n   <div>\r\n      <h4>জেলা ব্র্যান্ডিং এর কর্মপরিকল্পনা</h4>\r\n      {{items.details_plan | raw}}    \r\n   </div>\r\n   <div>\r\n      <h4>জেলা ব্র্যান্ডিং ভিডিও গ্যালারী</h4>\r\n      <iframe src=\"{{items.video_link}}\" frameborder=\"0\"></iframe>    \r\n   </div>\r\n</div>\r\n\r\n<style>\r\n    .district_branding .image, .district_branding .image p {\r\n        text-align: center;\r\n    }\r\n    .district_branding li {\r\n        margin-left: 20px;\r\n        line-height: 18px;\r\n        margin-bottom: 12px;\r\n    }\r\n    .district_branding strong {\r\n        font-weight: bold\r\n    }\r\n    .district_branding h4 {\r\n        margin-top: 10px;\r\n        font-size: 22px;\r\n    }\r\n</style>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\DistrictBranding\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"where\",\r\n        \"params\": [\r\n          \"slug\",\r\n          \"?slug\"\r\n        ]\r\n      },\r\n      {\r\n        \"name\": \"first\"\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-09-13 12:32:52', '2019-10-15 12:59:42', '');
INSERT INTO `system_mail_partials` (`id`, `name`, `code`, `content_html`, `content_text`, `is_custom`, `created_at`, `updated_at`, `content_html_en`) VALUES
(86, 'details-field_office-default', 'details-field_office-default', '<div class=\"office_title\">\r\n   <h4>{{items.title}}</h4>\r\n</div>\r\n<div id=\"vtab\">\r\n   <ul>\r\n      <li class=\"side-menu selected selected-button\" data-field=\"field_office_cism\" >কী সেবা কীভাবে পাবেন</li>\r\n      <li class=\"side-menu\" data-field=\"field_process_maps_nid\">প্রদেয় সেবাসমুহের তালিকা</li>\r\n      <li class=\"side-menu\" data-field=\"field_citizen_charter\">সিটিজেন চার্টার</li>\r\n      <li class=\"side-menu\" data-field=\"field_important_info\">সাধারণ তথ্য</li>\r\n      <li class=\"side-menu\" data-field=\"attachment\">সাংগঠনিক কাঠামো</li>\r\n      <li class=\"side-menu\" data-field=\"field_e_directory_nid\">কর্মকর্তাবৃন্দ</li>\r\n      <li class=\"side-menu\" data-field=\"field_info_officer_nid\">তথ্য প্রদানকারী কর্মকর্তা</li>\r\n      <li class=\"side-menu\" data-field=\"field_staff_office_nid\">কর্মচারীবৃন্দ</li>\r\n      <li class=\"side-menu\" data-field=\"field_notice_node_ref_nid\">বিজ্ঞপ্তি</li>\r\n      <li class=\"side-menu\" data-field=\"field_ref_gov_download_nid\">ডাউনলোড</li>\r\n      <li class=\"side-menu\" data-field=\"field_law_circular_nid\">আইন ও সার্কুলার</li>\r\n      <li class=\"side-menu\" data-field=\"field_photo_gallery_office_nid\">ফটোগ্যালারি</li>\r\n      <li class=\"side-menu\" data-field=\"field_projects\">প্রকল্পসমূহ</li>\r\n      <li class=\"side-menu\" data-field=\"field_address\">যোগাযোগ</li>\r\n   </ul>\r\n   <div class=\"row\" style=\"display: block;\" id=\"field_office_cism\">\r\n      <h4>কী সেবা কীভাবে পাবেন</h4>\r\n      <div>{{items.field_office_cism | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_process_maps_nid\">\r\n      <h4>প্রদেয় সেবাসমুহের তালিকা</h4>\r\n      <div>\r\n          <ul style=\"margin-left: 20px\">\r\n          {% for lp in items.field_process_maps_nid %}\r\n              <li>{{ lp.title }}</li>\r\n          {% endfor %}\r\n          </ul>\r\n      </div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_citizen_charter\">\r\n      <h4>সিটিজেন চার্টার</h4>\r\n      <div>{{items.field_citizen_charter | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_important_info\">\r\n      <h4>সাধারণ তথ্য</h4>\r\n      <div>{{items.field_important_info | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"attachment\">\r\n      <h4>সাংগঠনিক কাঠামো</h4>\r\n      <div>\r\n          {% partial \'control-pdfviewer\' data=items.attachment body%}\r\n          {% endpartial %}\r\n      </div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_e_directory_nid\">\r\n      {% partial \'control-teachers-list\' url=url items=items.field_e_directory_nid title=\'কর্মকর্তাবৃন্দ\' body%}\r\n      {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_info_officer_nid\">\r\n      {% partial \'control-teachers-list\' url=url items=items.field_info_officer_nid_taxonomy title=\'তথ্য প্রদানকারী কর্মকর্তা\' body%}\r\n      {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_staff_office_nid\">\r\n      {% partial \'control-teachers-list\' url=url items=items.field_staff_office_nid title=\'কর্মচারীবৃন্দ\' body%}\r\n      {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_notice_node_ref_nid\">\r\n      <h4>বিজ্ঞপ্তি</h4>\r\n      <div>\r\n          <ul style=\"margin-left: 20px\">\r\n          {% for n in items.field_notice_node_ref_nid %}\r\n              <li><a target=\"_blank\" href=\"http://{{domain}}/{{lang}}/site/notices/{{n.slug}}\">{{ n.title }}</a></li>\r\n          {% endfor %}\r\n          </ul>\r\n      </div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_ref_gov_download_nid\">\r\n      <h4>ডাউনলোড</h4>\r\n      <div>\r\n          {% for files in items.field_ref_gov_download_nid %}\r\n              {% for file in files.attachments %}\r\n                  <p>\r\n                  {% partial \'control-file\' ext=file.extension name=file.file_name path=file.path display_file_name=true body%}\r\n                  {% endpartial %}\r\n                  </p>\r\n              {% endfor %}\r\n          {% endfor %}\r\n      </div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_law_circular_nid\">\r\n      <h4>আইন ও সার্কুলার</h4>\r\n      <div>\r\n          <ul style=\"margin-left: 20px\">\r\n          {% for lp in items.field_law_circular_nid %}\r\n              <li>{{ lp.title }}</li>\r\n          {% endfor %}\r\n          </ul>\r\n      </div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_photo_gallery_office_nid\">\r\n       {% partial \'control-photo-gallery\' url=url items=items.field_photo_gallery_office_nid body%}\r\n       {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_projects\">\r\n      <h4>প্রকল্পসমূহ</h4>\r\n      <div>{{items.field_projects | raw}}</div>   \r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_address\">\r\n      <h4>যোগাযোগ</h4>\r\n      <div>{{items.field_address | raw}}</div>\r\n   </div>\r\n</div>\r\n\r\n<script>\r\n\r\n    var lis = document.querySelectorAll(\'#vtab ul li.side-menu\');\r\n    var lislen = lis.length;\r\n    \r\n    var addClass = function(el, klass) {\r\n        if(!el.classList.contains(klass)) {\r\n            el.classList.add(klass);\r\n        }\r\n    }\r\n    \r\n    var removeClass = function(el, klass) {\r\n        if(el.classList.contains(klass)) {\r\n            el.classList.remove(klass);\r\n        }\r\n    }\r\n    \r\n    for(var i=0; i<lislen; i++) {\r\n        var el = lis[i];\r\n        el.addEventListener(\'click\', function(e) {\r\n            \r\n            for(var j=0; j<lislen; j++) {\r\n                removeClass(lis[j], \'selected\');\r\n                removeClass(lis[j], \'selected-button\');\r\n            }\r\n            \r\n            addClass(this, \'selected\');\r\n            addClass(this, \'selected-button\');\r\n            \r\n            var div = document.querySelector(\'#\' + this.dataset.field);\r\n            var divs = document.querySelectorAll(\'#vtab .row\');\r\n            for(var k=0; k<divs.length; k++) {\r\n                divs[k].style.display = \'none\';\r\n            }\r\n            div.style.display = \'block\';\r\n        });\r\n    }    \r\n\r\n</script>\r\n\r\n{% if(items.is_right_side_bar) %}\r\n<style>\r\n    .right-side-bar {\r\n        display: none;\r\n    }\r\n</style>\r\n{% endif %}\r\n\r\n<style>\r\n\r\n.office_title h4{\r\n    font-size: 21px;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n#vtab {\r\n    margin: auto;\r\n    width: 100%;\r\n    height: auto;\r\n}\r\n\r\n#vtab .photo {\r\n    width: 100px;    \r\n}\r\n\r\n#vtab td {\r\n    padding: 10px;\r\n}\r\n\r\n#vtab > div > h4 {\r\n    font-size: 1.2em;\r\n    border-bottom: 1px dashed gray;\r\n    padding-top: 5px;\r\n    margin-top: 0;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n#vtab > ul {\r\n    float: left;\r\n    width: 200px;\r\n    text-align: left;\r\n    display: block;\r\n    margin: auto 0;\r\n    padding: 0;\r\n    position: relative;\r\n    border: 1px solid #ddd;\r\n}\r\n\r\n#vtab > ul > li {\r\n    list-style-type: none;\r\n    display: block;\r\n    margin: auto;\r\n    padding: 10px;\r\n    border-bottom: 2px solid #fafafa;\r\n    position: relative;\r\n    background-color: white !important;\r\n    cursor: pointer;\r\n}\r\n\r\n#vtab > div {\r\n    margin-left: 200px;\r\n    min-height: 500px;\r\n    padding: 12px;\r\n    position: relative;\r\n}\r\n\r\n#vtab .selected-button {\r\n    box-shadow: 0 2px 3px rgba(0,0,0,0.16);\r\n    border: 1px solid #aaa;\r\n    border-top: 1px solid #ccc;\r\n    border-left: 1px solid #ccc;\r\n}\r\n\r\n#vtab > ul > li.selected {\r\n    border-right: none;\r\n    background-color: white !important;\r\n    position: relative;\r\n    font-weight: bold;\r\n    text-shadow: none;\r\n    border-radius: 3px;\r\n    color: #444;\r\n    font-size: 11px;\r\n    font-weight: bold;\r\n    text-decoration: none;\r\n    line-height: normal;\r\n    background: #eee;\r\n    background: #eee -moz-linear-gradient(top, rgba(255,255,255,.2) 0%, rgba(0,0,0,.2) 100%);\r\n    background: #eee -webkit-gradient(linear, left top, left bottom, color-stop(0%,rgba(255,255,255,.2)), color-stop(100%,rgba(0,0,0,.2)));\r\n    background: #eee -webkit-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -o-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -ms-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n}\r\n\r\n\r\n</style>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\FieldOffice\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"gets\",\r\n	\"params\":[ \"slug\",\"?slug\" ]\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-09-16 05:57:45', '2019-10-29 09:50:08', '<div id=\"vtab\">\r\n   <ul>\r\n      <li class=\"selected selected-button\" data-field=\"field_office_cism\" >কী সেবা কীভাবে পাবেন</li>\r\n      <li data-field=\"field_process_maps_nid\">প্রদেয় সেবাসমুহের তালিকা</li>\r\n      <li data-field=\"field_citizen_charter\">সিটিজেন চার্টার</li>\r\n      <li data-field=\"field_important_info\">সাধারণ তথ্য</li>\r\n      <li data-field=\"attachment\">সাংগঠনিক কাঠামো</li>\r\n      <li data-field=\"field_e_directory_nid\">কর্মকর্তাবৃন্দ</li>\r\n      <li data-field=\"field_info_officer_nid\">তথ্য প্রদানকারী কর্মকর্তা</li>\r\n      <li data-field=\"field_staff_office_nid\">কর্মচারীবৃন্দ</li>\r\n      <li data-field=\"field_notice_node_ref_nid\">বিজ্ঞপ্তি</li>\r\n      <li data-field=\"field_ref_gov_download_nid\">ডাউনলোড</li>\r\n  