(87, 'list-info_officer-default-old', 'list-info_officer-default', '<h3 class=\"title\">তথ্য প্রদানকারী কর্মকর্তা </h3>\r\n<div class=\"info-officer\">\r\n    <div class=\"left\">\r\n        <select id=\"category\">\r\n            <option value=\"ALL\">ALL</option>\r\n            {% for o in items.layers %}\r\n                <option value=\"{{o.id}}\">{{o.name}}</option>\r\n            {% endfor %}\r\n        </select>\r\n    </div>\r\n    <div class=\"right\">\r\n        <a class=\"btn\" onclick=\"officer_withoutpic()\" title=\"তথ্য প্রদানকারী কর্মকর্তাগণের তালিকা ছবি ছাড়া\">তথ্য প্রদানকারী কর্মকর্তাগণের তালিকা ছবি ছাড়া</a>\r\n    </div>\r\n</div>\r\n{% partial \'control-officer-list\' url=url _code=_code items=items.officers body%}\r\n{% endpartial %}\r\n{{ list_data.pagination | raw }}\r\n\r\n<style>\r\n    .info-officer {\r\n        display: flex;    \r\n        margin-bottom: 10px;\r\n    }\r\n    .info-officer .left, .info-officer .right {\r\n        flex: 1;\r\n        align-items: center;\r\n    }\r\n    .info-officer .right {\r\n        justify-content: flex-end;\r\n        display: flex;\r\n    }\r\n    .info-officer .left select {\r\n        width: 220px;\r\n    }\r\n</style>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\InfoOfficer\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"gets\"\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-09-26 13:38:42', '2019-12-29 04:47:23', '<h3 class=\"title\">Information Officer\'s List</h3>\r\n<div class=\"info-officer\">\r\n    <div class=\"left\">\r\n        <select id=\"category\">\r\n            <option value=\"ALL\">ALL</option>\r\n            {% for o in items.layers %}\r\n                <option value=\"{{o.id}}\">{{o.name}}</option>\r\n            {% endfor %}\r\n        </select>\r\n    </div>\r\n    <div class=\"right\">\r\n        <a class=\"btn\" onclick=\"officer_withoutpic()\" title=\"Information Ofiicer\'s List Without Picture\">Information Ofiicer\'s List Without Picture</a>\r\n