(88, 'control-officer-list-old', 'control-officer-list', '<table class=\"table table-bordered info-officer-table\">\r\n  <thead class=\"thead-dark\">\r\n    <tr>\r\n        <th>অফিসের নাম</th>\r\n        <th>নাম</th>\r\n        <th class=\"photo-column\">ছবি</th>\r\n        <th>মোবাইল</th>\r\n        <th>ই-মেইল</th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    {% for item in items %}\r\n        <tr>\r\n            <td> office name </td>\r\n            <td>\r\n                <a href=\"{{url}}/site/{{_code}}/{{item.slug}}\">{{item.officer.title}}</a>\r\n            </td>\r\n            <td class=\"photo-column\">\r\n                <img width=\"100\" src=\"https://image.shutterstock.com/image-vector/male-default-placeholder-avatar-profile-260nw-387516193.jpg\" />\r\n            </td>\r\n            <td>{{item.officer.mobile}}</td>\r\n            <td>{{item.officer.email}}</td>\r\n        </tr>\r\n    {% endfor %}\r\n  </tbody>\r\n</table>\r\n\r\n<script>\r\n    function officer_withoutpic() {\r\n        var photoColumns = document.querySelectorAll(\'.info-officer-table .photo-column\');\r\n        if (photoColumns) {\r\n            for (var i=0; i<photoColumns.length; i++) {\r\n                var el = photoColumns[i];\r\n                if (el.style.display == \'none\') {\r\n                    el.style.display = \'block\'\r\n                }\r\n                else {\r\n                    el.style.display = \'none\'\r\n                }\r\n            }\r\n        }\r\n    }\r\n</script>', '', 1, '2019-10-15 11:28:19', '2019-12-29 04:47:43', '<table class=\"table table-bordered info-officer-table\">\r\n  <thead class=\"thead-dark\">\r\n    <tr>\r\n        <th>Office Name</th>\r\n        <th>Name</th>\r\n        <th class=\"photo-column\">Photo</th>\r\n        <th>Mobile</th>\r\n        <th>Email</th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    {% for item in items %}\r\n        <tr>\r\n            <td> office name </td>\r\n            <td>\r\n               