dpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_14\">\r\n      <h4>যোগাযোগ</h4>\r\n      <div>{{items.field_contact | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_15\">\r\n      <h4>মেধাবী ছাত্রবৃন্দ</h4>\r\n      <div>{{items.field_edu_outstanding_students | raw}}</div>\r\n   </div>\r\n</div>\r\n\r\n<script>\r\n\r\n    var lis = document.querySelectorAll(\'#vtab ul li.side-menu\');\r\n    var lislen = lis.length;\r\n    \r\n    var addClass = function(el, klass) {\r\n        if(!el.classList.contains(klass)) {\r\n            el.classList.add(klass);\r\n        }\r\n    }\r\n    \r\n    var removeClass = function(el, klass) {\r\n        if(el.classList.contains(klass)) {\r\n            el.classList.remove(klass);\r\n        }\r\n    }\r\n    \r\n    for(var i=0; i<lislen; i++) {\r\n        var el = lis[i];\r\n        el.addEventListener(\'click\', function(e) {\r\n            \r\n            for(var j=0; j<lislen; j++) {\r\n                removeClass(lis[j], \'selected\');\r\n                removeClass(lis[j], \'selected-button\');\r\n            }\r\n            \r\n            addClass(this, \'selected\');\r\n            addClass(this, \'selected-button\');\r\n            \r\n            var div = document.querySelector(\'#\' + this.dataset.field);\r\n            var divs = document.querySelectorAll(\'#vtab .row\');\r\n            for(var k=0; k<divs.length; k++) {\r\n                divs[k].style.display = \'none\';\r\n            }\r\n            div.style.display = \'block\';\r\n        });\r\n    }\r\n    \r\n    // Gallery\r\n    var firstImage = document.querySelector(\'#vtab #mygallery .images > div\');\r\n    if(firstImage) {\r\n        firstImage.classList.add(\'active\');\r\n    }\r\n    var firstThumb = document.querySelector(\'#vtab #mygallery .thumbs > div\');\r\n    if(firstThumb) {\r\n        firstThumb.classList.add(\'active\');\r\n    }\r\n    Gallery.init(document.getElementById(\'mygallery\'));\r\n    // End Gallery\r\n    \r\n\r\n</script>\r\n\r\n{% if(items.is_right_side_bar) %}\r\n<style>\r\n    .right-side-bar {\r\n        display: none;\r\n    }\r\n</style>\r\n{% endif %}\r\n\r\n<style>\r\n\r\n.institute_title h4{\r\n    font-size: 21px;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n.institute_image {\r\n    max-width: 700px;    \r\n}\r\n\r\n#vtab {\r\n    margin: auto;\r\n    width: 100%;\r\n    height: auto;\r\n}\r\n\r\n#vtab .photo {\r\n    width: 100px;    \r\n}\r\n\r\n#vtab td {\r\n    padding: 10px;\r\n}\r\n\r\n#vtab > div > h4 {\r\n    font-size: 1.2em;\r\n    border-bottom: 1px dashed gray;\r\n    padding-top: 5px;\r\n    margin-top: 0;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n#vtab > ul {\r\n    float: left;\r\n    width: 200px;\r\n    text-align: left;\r\n    display: block;\r\n    margin: auto 0;\r\n    padding: 0;\r\n    position: relative;\r\n    border: 1px solid #ddd;\r\n}\r\n\r\n#vtab > ul > li {\r\n    list-style-type: none;\r\n    display: block;\r\n    margin: auto;\r\n    padding: 10px;\r\n    border-bottom: 2px solid #fafafa;\r\n    position: relative;\r\n    background-color: white !important;\r\n    cursor: pointer;\r\n}\r\n\r\n#vtab > div {\r\n    margin-left: 200px;\r\n    min-height: 500px;\r\n    padding: 12px;\r\n    position: relative;\r\n}\r\n\r\n#vtab .selected-button {\r\n    box-shadow: 0 2px 3px rgba(0,0,0,0.16);\r\n    border: 1px solid #aaa;\r\n    border-top: 1px solid #ccc;\r\n    border-left: 1px solid #ccc;\r\n}\r\n\r\n#vtab > ul > li.selected {\r\n    border-right: none;\r\n    background-color: white !important;\r\n    position: relative;\r\n    font-weight: bold;\r\n    text-shadow: none;\r\n    border-radius: 3px;\r\n    color: #444;\r\n    font-size: 11px;\r\n    font-weight: bold;\r\n    text-decoration: none;\r\n    line-height: normal;\r\n    background: #eee;\r\n    background: #eee -moz-linear-gradient(top, rgba(255,255,255,.2) 0%, rgba(0,0,0,.2) 100%);\r\n    background: #eee -webkit-gradient(linear, left top, left bottom, color-stop(0%,rgba(255,255,255,.2)), color-stop(100%,rgba(0,0,0,.2)));\r\n    background: #eee -webkit-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -o-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -ms-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n}\r\n\r\n\r\n</style>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\EducationInstitute\",\r\n    \"methods\": [\r\n      {\r\n        \"name\": \"where\",\r\n	\"params\":[ \"slug\",\"?slug\" ]\r\n      },\r\n     {\r\n        \"name\": \"first\"\r\n      }\r\n    ]\r\n  }\r\n}', 1, '2019-10-16 12:15:49', '2019-12-14 10:19:27', '<div class=\"back\"><a href=\"/{{lang}}/site/view/education_institute\">Back to List</a></div>\r\n<div class=\"institute_title\">\r\n   <h4>{{items.lang(en).title}}</h4>\r\n</div>\r\n<img class=\"institute_image\" src=\"{{items.image.path}}\" />\r\n<div id=\"vtab\">\r\n   <ul>\r\n      <li class=\"side-menu selected selected-button\" data-field=\"field_1\" >সংক্ষিপ্ত বর্ণনা</li>\r\n      <li class=\"side-menu\" data-field=\"field_2\">প্রতিষ্ঠাকাল</li>\r\n      <li class=\"side-menu\" data-field=\"field_3\">ইতিহাস</li>\r\n      <li class=\"side-menu\" data-field=\"field_4\">প্রধান শিক্ষক/ অধ্যক্ষ</li>\r\n      <li class=\"side-menu\" data-field=\"field_5\">অন্যান্য শিক্ষকদের তালিকা</li>\r\n      <li class=\"side-menu\" data-field=\"field_6\">ছাত্র-ছাত্রীর সংখ্যা (শ্রেণীভিত্তিক)</li>\r\n      <li class=\"side-menu\" data-field=\"field_7\">পাশের হার</li>\r\n      <li class=\"side-menu\" data-field=\"field_8\">বর্তমান পরিচালনা কমিটির তথ্য</li>\r\n      <li class=\"side-menu\" data-field=\"field_9\">বিগত ৫ বছরের সমাপনী/পাবলিক পরীক্ষার ফলাফল</li>\r\n      <li class=\"side-menu\" data-field=\"field_10\">শিক্ষাবৃত্ত তথ্যসমুহ</li>\r\n      <li class=\"side-menu\" data-field=\"field_11\">অর্জন</li>\r\n      <li class=\"side-menu\" data-field=\"field_12\">ভবিষৎ পরিকল্পনা</li>\r\n      <li class=\"side-menu\" data-field=\"field_13\">ফটোগ্যালারী</li>\r\n      <li class=\"side-menu\" data-field=\"field_14\">যোগাযোগ</li>\r\n      <li class=\"side-menu\" data-field=\"field_15\">মেধাবী ছাত্রবৃন্দ</li>\r\n   </ul>\r\n   <div class=\"row\" style=\"display: block;\" id=\"field_1\">\r\n      <h4>সংক্ষিপ্ত বর্ণনা</h4>\r\n      <div>{{items.field_description | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_2\">\r\n      <h4>প্রতিষ্ঠাকাল</h4>\r\n      <div>{{items.field_established_text}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_3\">\r\n      <h4>ইতিহাস</h4>\r\n      <div>{{items.field_history | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_4\">\r\n       {% partial \'control-teachers-list\' url=url items=items.head_master title=\'প্রধান শিক্ষক/ অধ্যক্ষ\' body%}\r\n       {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_5\">\r\n       {% partial \'control-teachers-list\' url=url items=items.field_e_directory_teachers_profile_nid title=\'অন্যান্য শিক্ষকদের তালিকা\' body%}\r\n       {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_6\">\r\n      <h4>ছাত্র-ছাত্রীর সংখ্যা (শ্রেণীভিত্তিক)</h4>\r\n      <div>{{items.field_student_class | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_7\">\r\n      <h4>পাশের হার</h4>\r\n      <div>{{items.field_passing_rate}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_8\">\r\n      <h4>বর্তমান পরিচালনা কমিটির তথ্য</h4>\r\n      <div>{{items.field_managing_committee | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_9\">\r\n      <h4>বিগত ৫ বছরের সমাপনী/পাবলিক পরীক্ষার ফলাফল</h4>\r\n      <div>{{items.field_last_five_yrs_result | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_10\">\r\n      <h4>শিক্ষাবৃত্ত তথ্যসমুহ</h4>\r\n      <div>{{items.field_edu_scholarship_info | raw}}</div>   \r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_11\">\r\n      <h4>অর্জন</h4>\r\n      <div>{{items.field_edu_achievements | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_12\">\r\n      <h4>ভবিষৎ পরিকল্পনা</h4>\r\n      <div>{{items.field_edu_future_plan | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_13\">\r\n       {% partial \'control-photo-gallery\' url=url items=items.field_photo_gallery_office_nid body%}\r\n       {% endpartial %}\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_14\">\r\n      <h4>যোগাযোগ</h4>\r\n      <div>{{items.field_contact | raw}}</div>\r\n   </div>\r\n   <div class=\"row\" style=\"display: none;\" id=\"field_15\">\r\n      <h4>মেধাবী ছাত্রবৃন্দ</h4>\r\n      <div>{{items.field_edu_outstanding_students | raw}}</div>\r\n   </div>\r\n</div>\r\n\r\n<script>\r\n\r\n    var lis = document.querySelectorAll(\'#vtab ul li.side-menu\');\r\n    var lislen = lis.length;\r\n    \r\n    var addClass = function(el, klass) {\r\n        if(!el.classList.contains(klass)) {\r\n            el.classList.add(klass);\r\n        }\r\n    }\r\n    \r\n    var removeClass = function(el, klass) {\r\n        if(el.classList.contains(klass)) {\r\n            el.classList.remove(klass);\r\n        }\r\n    }\r\n    \r\n    for(var i=0; i<lislen; i++) {\r\n        var el = lis[i];\r\n        el.addEventListener(\'click\', function(e) {\r\n            \r\n            for(var j=0; j<lislen; j++) {\r\n                removeClass(lis[j], \'selected\');\r\n                removeClass(lis[j], \'selected-button\');\r\n            }\r\n            \r\n            addClass(this, \'selected\');\r\n            addClass(this, \'selected-button\');\r\n            \r\n            var div = document.querySelector(\'#\' + this.dataset.field);\r\n            var divs = document.querySelectorAll(\'#vtab .row\');\r\n            for(var k=0; k<divs.length; k++) {\r\n                divs[k].style.display = \'none\';\r\n            }\r\n            div.style.display = \'block\';\r\n        });\r\n    }\r\n    \r\n    // Gallery\r\n    var firstImage = document.querySelector(\'#vtab #mygallery .images > div\');\r\n    if(firstImage) {\r\n        firstImage.classList.add(\'active\');\r\n    }\r\n    var firstThumb = document.querySelector(\'#vtab #mygallery .thumbs > div\');\r\n    if(firstThumb) {\r\n        firstThumb.classList.add(\'active\');\r\n    }\r\n    Gallery.init(document.getElementById(\'mygallery\'));\r\n    // End Gallery\r\n    \r\n\r\n</script>\r\n\r\n{% if(items.is_right_side_bar) %}\r\n<style>\r\n    .right-side-bar {\r\n        display: none;\r\n    }\r\n</style>\r\n{% endif %}\r\n\r\n<style>\r\n\r\n.institute_title h4{\r\n    font-size: 21px;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n.institute_image {\r\n    max-width: 700px;    \r\n}\r\n\r\n#vtab {\r\n    margin: auto;\r\n    width: 100%;\r\n    height: auto;\r\n}\r\n\r\n#vtab .photo {\r\n    width: 100px;    \r\n}\r\n\r\n#vtab td {\r\n    padding: 10px;\r\n}\r\n\r\n#vtab > div > h4 {\r\n    font-size: 1.2em;\r\n    border-bottom: 1px dashed gray;\r\n    padding-top: 5px;\r\n    margin-top: 0;\r\n    line-height: 30px;\r\n    margin-bottom: 4px;\r\n}\r\n\r\n#vtab > ul {\r\n    float: left;\r\n    width: 200px;\r\n    text-align: left;\r\n    display: block;\r\n    margin: auto 0;\r\n    padding: 0;\r\n    position: relative;\r\n    border: 1px solid #ddd;\r\n}\r\n\r\n#vtab > ul > li {\r\n    list-style-type: none;\r\n    display: block;\r\n    margin: auto;\r\n    padding: 10px;\r\n    border-bottom: 2px solid #fafafa;\r\n    position: relative;\r\n    background-color: white !important;\r\n    cursor: pointer;\r\n}\r\n\r\n#vtab > div {\r\n    margin-left: 200px;\r\n    min-height: 500px;\r\n    padding: 12px;\r\n    position: relative;\r\n}\r\n\r\n#vtab .selected-button {\r\n    box-shadow: 0 2px 3px rgba(0,0,0,0.16);\r\n    border: 1px solid #aaa;\r\n    border-top: 1px solid #ccc;\r\n    border-left: 1px solid #ccc;\r\n}\r\n\r\n#vtab > ul > li.selected {\r\n    border-right: none;\r\n    background-color: white !important;\r\n    position: relative;\r\n    font-weight: bold;\r\n    text-shadow: none;\r\n    border-radius: 3px;\r\n    color: #444;\r\n    font-size: 11px;\r\n    font-weight: bold;\r\n    text-decoration: none;\r\n    line-height: normal;\r\n    background: #eee;\r\n    background: #eee -moz-linear-gradient(top, rgba(255,255,255,.2) 0%, rgba(0,0,0,.2) 100%);\r\n    background: #eee -webkit-gradient(linear, left top, left bottom, color-stop(0%,rgba(255,255,255,.2)), color-stop(100%,rgba(0,0,0,.2)));\r\n    background: #eee -webkit-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -o-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee -ms-linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n    background: #eee linear-gradient(top, rgba(255,255,255,.2) 0%,rgba(0,0,0,.2) 100%);\r\n}\r\n\r\n\r\n</style>'),
(93, 'control-teachers-list', 'control-teachers-list', '<h4>{{title}}</h4>\r\n<div>\r\n    <table class=\"table table-bordered\">\r\n       <thead>\r\n          <tr>\r\n             <th>ছবি</th>\r\n             <th>নাম</th>\r\n             <th>মোবাইল</th>\r\n             <th>ইমেইল</th>\r\n          </tr>\r\n       </thead>\r\n       <tbody>\r\n       {% if items is iterable %}\r\n           {% for item in items %}\r\n               <tr>\r\n                  <td><img class=\"photo\" src=\"{{item.image.path}}\" /></td>\r\n                  <td>\r\n                      <a href=\"{{url}}/site/officer_list/{{item.slug}}\">{{item.title}}</a>\r\n                  </td>\r\n                  <td>{{item.mobile}}</td>\r\n                  <td>{{item.email}}</td>\r\n               </tr>\r\n           {% endfor %}\r\n       {% else %}\r\n           <tr>\r\n              <td><img class=\"photo\" src=\"{{items.image.path}}\" /></td>\r\n                  <td>\r\n                      <a href=\"{{url}}/site/officer_list/{{items.slug}}\">{{items.title}}</a>\r\n                  </td>\r\n              <td>{{items.mobile}}</td>\r\n              <td>{{items.email}}</td>\r\n          </tr>\r\n       {% endif %}\r\n       </tbody>\r\n    </table>\r\n</div>', '', 1, '2019-10-28 07:51:18', '2019-10-29 09:14:57', '<h4>{{title}}</h4>\r\n<div>\r\n    <table class=\"table table-bordered\">\r\n       <thead>\r\n          <tr>\r\n             <th>Photo</th>\r\n             <th>Name</th>\r\n             <th>Mobile</th>\r\n             <th>Email</th>\r\n          </tr>\r\n       </thead>\r\n       <tbody>\r\n       {% if items is iterable %}\r\n           {% for item in items %}\r\n               <tr>\r\n                  <td><img class=\"photo\" src=\"{{item.image.path}}\" /></td>\r\n                  <td>\r\n                      <a href=\"{{url}}/site/officer_list/{{item.slug}}\">{{item.title}}</a>\r\n                  </td>\r\n                  <td>{{item.mobile}}</td>\r\n                  <td>{{item.email}}</td>\r\n               </tr>\r\n           {% endfor %}\r\n       {% else %}\r\n           <tr>\r\n              <td><img class=\"photo\" src=\"{{items.image.path}}\" /></td>\r\n                  <td>\r\n                      <a href=\"{{url}}/site/officer_list/{{items.slug}}\">{{items.title}}</a>\r\n                  </td>\r\n              <td>{{items.mobile}}</td>\r\n              <td>{{items.email}}</td>\r\n          </tr>\r\n       {% endif %}\r\n       </tbody>\r\n    </table>\r\n</div>');
INSERT INTO `system_mail_partials` (`id`, `name`, `code`, `content_html`, `content_text`, `is_custom`, `created_at`, `updated_at`, `content_html_en`) VALUES
(94, 'control-photo-gallery', 'control-photo-gallery', '<link rel=\"stylesheet\" href=\"http://50.28.10.160/cdn/np/css/gallery.css\">\r\n<script src=\"https://cdnjs.cloudflare.com/ajax/libs/hammer.js/2.0.4/hammer.min.js\"></script>\r\n<script src=\"http://50.28.10.160/cdn/np/javascript/gallery.js\"></script>\r\n<h4>ফটোগ্যালারি</h4>\r\n<div>\r\n  <div id=\"mygallery\" class=\"gallery\">\r\n    <div class=\"images\">\r\n      {% for photos in items %}\r\n          {% for photo in photos.images %}\r\n              <div style=\"background-image: url({{photo.path}})\"></div>\r\n          {% endfor %}\r\n      {% endfor %}\r\n      <span class=\"left\"></span>\r\n      <span class=\"right\"></span>\r\n    </div>\r\n    <div class=\"thumbs\">\r\n      {% for photos in items %}\r\n          {% for photo in photos.images %}\r\n              <div style=\"background-image: url({{photo.path}})\"></div>\r\n          {% endfor %}\r\n      {% endfor %}\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<script>\r\n    // Gallery\r\n    var firstImage = document.querySelector(\'#vtab #mygallery .images > div\');\r\n    if(firstImage) {\r\n        firstImage.classList.add(\'active\');\r\n    }\r\n    var firstThumb = document.querySelector(\'#vtab #mygallery .thumbs > div\');\r\n    if(firstThumb) {\r\n        firstThumb.classList.add(\'active\');\r\n    }\r\n    Gallery.init(document.getElementById(\'mygallery\'));\r\n    // End Gallery\r\n</script>', '', 1, '2019-10-29 09:20:41', '2019-10-29 09:32:20', ''),
(96, 'Officers List', 'list-officers-default', '{{dump(items)}}', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\OfficerList\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"publish\",1]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"sort_order\",\"asc\"]\r\n                            },\r\n                              {\r\n                                \"name\":\"simplePaginate\",\r\n                                \"params\":[100]\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 1, '2019-12-01 01:58:16', '2019-12-01 02:00:49', ''),
(97, 'details-officer_list-default', 'details-officer_list-default', '<div class=\"container-fluid\">\r\n    <div class=\"row\">\r\n        <div class=\"col-12 mt-3\">\r\n            <div class=\"card\">\r\n                <div class=\"card-horizontal\">\r\n                    <div class=\"img-square-wrapper\">\r\n                        {% set imgUrl = item.image.path? item.image.path : \'http://cdn.sylhet.gov.bd/media/central/themes/default/img/280x320.png\'%}\r\n                        <img class=\"\" src=\"{{ imgUrl }}\" alt=\"Card image cap\">\r\n                    </div>\r\n                    <div class=\"card-body\">\r\n                        <h4 class=\"card-title\">{{item.title}}</h4>\r\n                        <p>{{item.designation}}</p>\r\n                        <hr>\r\n                        <div class=\"card-text\">\r\n                           \r\n						   {% if item.mobile %} \r\n							<p><b>মোবাইল </b> : {{item.mobile}}</p>\r\n						   {% endif %}\r\n						   \r\n							{% if item.phone_office %} \r\n								<p><b>ফোন (অফিস) </b> : {{item.phone_office}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.email %}	\r\n								<p><b>ইমেইল </b> : {{item.email}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.fax %}	\r\n								<p><b>ফ্যাক্স </b> : {{item.fax}}</p>\r\n						    {% endif %}\r\n							\r\n							{%if item.field_batch%}\r\n								<p><b>ব্যাচ (বিসিএস) </b> : {{item.field_batch}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_current_join_date %}\r\n								<p><b> বর্তমান কর্মস্থলে যোগদানের তারিখ</b> : {{item.field_current_join_date|date(\"m-d-Y\")}}</p>\r\n							{% endif %}	\r\n                           \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n.card-horizontal {\r\n    display: flex;\r\n    flex: 1 1 auto;\r\n}\r\n\r\n</style>', '{\r\n                     \"item\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\OfficerList\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"slug\",\"?slug\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"first\"\r\n                            }\r\n                            \r\n                        ]\r\n                     }\r\n                }', 1, '2019-12-02 02:19:43', '2019-12-03 00:36:00', ''),
(98, 'filter-taxonomy-dropdown', 'filter-taxonomy-dropdown', '<div class=\"col texonomy-dropdown\">\r\n    \r\n    <select name=\"{{filter.name}}\" id=\"{{filter.name}}\" class=\"form-control\" onchange=\"onChangeAppendQs(this)\">\r\n        \r\n        <option value=\"\">{{filter.label}}</option>\r\n        {% for key,value in filter.data %}\r\n            <option value=\"{{key}}\" {{ key==q[filter.name]?\'selected\':\'\' }}>{{value}}</option>\r\n        {% endfor %}\r\n        \r\n        \r\n    </select>\r\n\r\n</div>', '', 1, '2019-12-03 23:45:47', '2019-12-23 03:35:40', '<div class=\"col\">\r\n    \r\n    <select name=\"{{filter.name}}\" id=\"{{filter.name}}\" class=\"form-control\">\r\n        \r\n        <option value=\"\">{{filter.label}}</option>\r\n        {% for key,value in filter.data %}\r\n            <option value=\"{{key}}\">{{value}}</option>\r\n        {% endfor %}\r\n        \r\n        \r\n    </select>\r\n\r\n</div>'),
(99, 'filter-search', 'filter-search', '<div class=\"col search\">\r\n   \r\n    <div class=\"input-group mb-2 mr-sm-2\">\r\n    \r\n        <input type=\"text\" class=\"form-control\" name=\"q\" value=\"{{q.q}}\" class=\"form-control\" id=\'q\'>\r\n        \r\n          <div class=\"input-group-append\">\r\n          \r\n              <div class=\"input-group-text\"><i class=\"fa fa-search\" onclick=\"listSearchClick(this)\"></i></div>\r\n          \r\n          </div>\r\n        \r\n   </div>\r\n    \r\n</div>', '', 1, '2019-12-05 00:03:26', '2019-12-23 03:35:22', ''),
(100, 'details-control-text', 'details-control-text', '{{value}}', '', 1, '2019-12-09 04:09:02', '2019-12-23 04:50:54', ''),
(101, 'details-control-file', 'details-control-file', '{% if value is not iterable %}\r\n    {% set value = [value] %}\r\n{% endif %}\r\n\r\n{% for v in value %}\r\n    \r\n    {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension display_file_name=true body%}\r\n    {% endpartial %}    \r\n    <iframe width=\"100%\" height=\"600\" src=\"{{v.path}}\"></iframe>\r\n{% endfor %}\r\n{% if(data.path) %}\r\n    {% partial \'control-file\' name=data.file_name path=data.path ext=data.extension display_file_name=true body%}\r\n    {% endpartial %}\r\n    <iframe width=\"100%\" height=\"600\" src=\"{{data.path}}\"></iframe>\r\n{% endif %}', '', 1, '2019-12-09 04:12:10', '2019-12-12 22:30:59', '{% for v in value %}\r\n    {% partial \'control-file\' name=v.file_name path=v.path ext=v.extension display_file_name=true body%}\r\n    {% endpartial %}    \r\n    <iframe width=\"100%\" height=\"600\" src=\"{{v.path}}\"></iframe>\r\n{% endfor %}\r\n{% if(data.path) %}\r\n    {% partial \'control-file\' name=data.file_name path=data.path ext=data.extension display_file_name=true body%}\r\n    {% endpartial %}\r\n    <iframe width=\"100%\" height=\"600\" src=\"{{data.path}}\"></iframe>\r\n{% endif %}'),
