(106, 'list-education_institutes-default', 'list-education_institutes-default', '<h3 class=\"title\">শিক্ষা প্রতিষ্ঠানের তালিকা</h3>\r\n\r\n<ul class=\"list-group col-4md-6\">\r\n\r\n    {% for taxonomy in items %}\r\n      <li class=\"list-group-item d-flex justify-content-between align-items-center\">\r\n        <a href=\"/{{lang}}/site/view/education_institute?institute_type={{taxonomy.id}}\">{{taxonomy.name}}</a>\r\n        <span class=\"badge badge-primary badge-pill\">\r\n         {{taxonomy.educational_institutes_count|length > 0 ? taxonomy.educational_institutes_count.0.count:0}}\r\n        </span>\r\n      </li>\r\n    {% endfor %}\r\n\r\n</ul>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\Taxonomy\",\r\n    \"methods\": [\r\n       {\r\n        \"name\": \"getInstitutesWithCount\"\r\n       }\r\n     ]\r\n  }\r\n}', 1, '2019-12-13 22:15:05', '2019-12-28 23:45:37', '<h3 class=\"title\">শিক্ষা প্রতিষ্ঠানের তালিকা</h3>\r\n\r\n<ul class=\"list-group col-4md-6\">\r\n\r\n    {% for taxonomy in items %}\r\n      <li class=\"list-group-item d-flex justify-content-between align-items-center\">\r\n        <a href=\"/{{lang}}/site/view/education_institute?institute_type={{taxonomy.id}}\">{{taxonomy.name}}</a>\r\n        <span class=\"badge badge-primary badge-pill\">\r\n         {{taxonomy.educational_institutes_count|length > 0 ? taxonomy.educational_institutes_count.0.count:0}}\r\n        </span>\r\n      </li>\r\n    {% endfor %}\r\n\r\n</ul>'),
(107, 'list-video-gallery-default', 'list-video-gallery-default', '<br>\r\n<h3 class=\"title\">ভিডিও গ্যালারি</h3>\r\n<hr>\r\n<ul class=\"youtube-videogallery\">\r\n    {% for item in items %}\r\n        <li><a href=\"{{item.video_link}}\">{{item.title}}</a>{{item.title}}</li>\r\n    {% endfor %}\r\n</ul>\r\n\r\n{{ items.withPath(\'\').links()|raw }}', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\VideoGallery\",\r\n    \"methods\": [\r\n	   {\r\n		\"name\":\"orderBy\",\r\n		\"params\":[\"created_at\",\"desc\"]\r\n	   },\r\n      {\r\n		\"name\":\"simplePaginate\",\r\n		\"params\":[20]\r\n	   }\r\n    ]\r\n  }\r\n}', 1, '2019-12-15 01:09:16', '2019-12-15 03:35:52', ''),
(108, 'filter-layers', 'filter-layers', '<div class=\"col layers\">\r\n    \r\n    <select name=\"layer_id\" id=\"layer_id\" class=\"form-control\" onchange=\"onChangeAppendQs(this)\">\r\n        \r\n       \r\n            \r\n            <option value=\"\">{{listTitle}}</option>\r\n            {% for layer in layers %}\r\n                <option value=\"{{layer[\'id\']}}\" {{ layer[\'id\']==q[\'layer_id\']?\'selected\':\'\' }}>{{layer[\'name\']}}</option>\r\n            {% endfor %}\r\n          \r\n    </select>\r\n\r\n</div>', '', 1, '2019-12-20 10:17:33', '2019-12-23 03:35:10', ''),
(109, 'details-control-photo-gallery', 'details-control-photo-gallery', '<link rel=\"stylesheet\" href=\"http://50.28.10.160/cdn/np/css/gallery.css\">\r\n<script src=\"https://cdnjs.cloudflare.com/ajax/libs/hammer.js/2.0.4/hammer.min.js\"></script>\r\n<script src=\"http://50.28.10.160/cdn/np/javascript/gallery.js\"></script>\r\n{{code}}\r\n<div>\r\n  <div id=\"mygallery\" class=\"gallery\">\r\n    <div class=\"images\">\r\n      \r\n          {% for photo in value %}\r\n              <div style=\"background-image: url({{photo.path}})\"></div>\r\n          {% endfor %}\r\n      \r\n      <span class=\"left\"></span>\r\n      <span class=\"right\"></span>\r\n    </div>\r\n    <div class=\"thumbs\">\r\n      \r\n          {% for photo in value %}\r\n              <div style=\"background-image: url({{photo.path}})\"></div>\r\n          {% endfor %}\r\n      \r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<script>\r\n    // Gallery\r\n    var firstImage = document.querySelector(\'#mygallery .images > div\');\r\n    if(firstImage) {\r\n        firstImage.classList.add(\'active\');\r\n    }\r\n    var firstThumb = document.querySelector(\'#mygallery .thumbs > div\');\r\n    if(firstThumb) {\r\n        firstThumb.classList.add(\'active\');\r\n    }\r\n    Gallery.init(document.getElementById(\'mygallery\'));\r\n    // End Gallery\r\n</script>', '', 1, '2019-12-23 01:02:13', '2019-12-23 01:17:43', ''),
(110, 'list-religious_institutes_count-default', 'list-religious_institutes_count-default', '<h3 class=\"title\">ধর্মীয় প্রতিষ্ঠানের তালিকা</h3>\r\n\r\n<ul class=\"list-group col-4md-6\">\r\n\r\n    {% for taxonomy in items %}\r\n      <li class=\"list-group-item d-flex justify-content-between align-items-center\">\r\n        <a href=\"{{view_link(\'religious_institutes\',lang)}}?institute_type={{taxonomy.id}}\">{{taxonomy.name}}</a>\r\n        <span class=\"badge badge-primary badge-pill\">\r\n         {{taxonomy.educational_institutes_count|length > 0 ? taxonomy.educational_institutes_count.0.count:0}}\r\n        </span>\r\n      </li>\r\n    {% endfor %}\r\n\r\n</ul>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\Taxonomy\",\r\n    \"methods\": [\r\n       {\r\n        \"name\": \"getReligiousInstitutesWithCount\"\r\n       }\r\n     ]\r\n  }\r\n}', 1, '2019-12-24 03:01:16', '2019-12-29 00:56:26', '<h3 class=\"title\">ধর্মীয় প্রতিষ্ঠানের তালিকা</h3>\r\n\r\n<ul class=\"list-group col-4md-6\">\r\n\r\n    {% for taxonomy in items %}\r\n      <li class=\"list-group-item d-flex justify-content-between align-items-center\">\r\n        <a href=\"{{view_link(\'religious_institutes\',lang)}}?institute_type={{taxonomy.id}}\">{{taxonomy.name}}</a>\r\n        <span class=\"badge badge-primary badge-pill\">\r\n         {{taxonomy.educational_institutes_count|length > 0 ? taxonomy.educational_institutes_count.0.count:0}}\r\n        </span>\r\n      </li>\r\n    {% endfor %}\r\n\r\n</ul>'),
(111, 'details-control-taxonomy', 'details-control-taxonomy', '{% set relation = name~\'_taxonomy\' %}\r\n\r\n{% set taxonomy = attribute(item, relation) %}\r\n\r\n{{taxonomy.name}}', '', 1, '2019-12-29 01:16:40', '2019-12-29 01:28:19', '{% set relation = name~\'_taxonomy\' %}\r\n\r\n{% set taxonomy = attribute(item, relation) %}\r\n\r\n{{taxonomy.lang(\'en\').name}}'),
(112, 'details-leaders-default', 'details-leaders-default', '<div class=\"container-fluid\">\r\n    <div class=\"row\">\r\n        <div class=\"col-12 mt-3\">\r\n            <div class=\"card\">\r\n                <div class=\"card-horizontal\">\r\n                    <div class=\"img-square-wrapper\">\r\n                        {% set imgUrl = item.image.path? item.image.path : \'http://cdn.sylhet.gov.bd/media/central/themes/default/img/280x320.png\'%}\r\n                        <img class=\"\" src=\"{{ imgUrl }}\" alt=\"Card image cap\">\r\n                    </div>\r\n                    <div class=\"card-body\">\r\n                        <h4 class=\"card-title\">{{item.title}}</h4>\r\n                        <p>{{item.designation_taxonomy.name}}</p>\r\n                        <hr>\r\n                        <div class=\"card-text\">\r\n                           \r\n						   {% if item.field_mobile %} \r\n							<p><b>মোবাইল </b> : {{item.field_mobile}}</p>\r\n						   {% endif %}\r\n						   \r\n							{% if item.field_phone_office %} \r\n								<p><b>ফোন (অফিস) </b> : {{item.field_phone_office}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_email %}	\r\n								<p><b>ইমেইল </b> : {{item.field_email}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_fax %}	\r\n								<p><b>ফ্যাক্স </b> : {{item.field_fax}}</p>\r\n						    {% endif %}\r\n							\r\n						\r\n							{% if item.field_highest_educational_degree %}\r\n								<p><b> সর্বশেষ শিক্ষাগত যোগ্যতা</b> : {{item.field_highest_educational_degree.name}}</p>\r\n							{% endif %}	\r\n                           \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n.card-horizontal {\r\n    display: flex;\r\n    flex: 1 1 auto;\r\n}\r\n\r\n</style>', '{\r\n                     \"item\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\Leaders\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"slug\",\"?slug\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"first\"\r\n                            }\r\n                            \r\n                        ]\r\n                     }\r\n                }', 1, '2020-01-08 03:49:56', '2020-01-08 04:03:31', '<div class=\"container-fluid\">\r\n    <div class=\"row\">\r\n        <div class=\"col-12 mt-3\">\r\n            <div class=\"card\">\r\n                <div class=\"card-horizontal\">\r\n                    <div class=\"img-square-wrapper\">\r\n                        {% set imgUrl = item.image.path? item.image.path : \'http://cdn.sylhet.gov.bd/media/central/themes/default/img/280x320.png\'%}\r\n                        <img class=\"\" src=\"{{ imgUrl }}\" alt=\"Card image cap\">\r\n                    </div>\r\n                    <div class=\"card-body\">\r\n                        <h4 class=\"card-title\">{{item.title}}</h4>\r\n                        <p>{{item.designation_taxonomy.name}}</p>\r\n                        <hr>\r\n                        <div class=\"card-text\">\r\n                           \r\n						   {% if item.field_mobile %} \r\n							<p><b>মোবাইল </b> : {{item.field_mobile}}</p>\r\n						   {% endif %}\r\n						   \r\n							{% if item.field_phone_office %} \r\n								<p><b>ফোন (অফিস) </b> : {{item.field_phone_office}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_email %}	\r\n								<p><b>ইমেইল </b> : {{item.field_email}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_fax %}	\r\n								<p><b>ফ্যাক্স </b> : {{item.field_fax}}</p>\r\n						    {% endif %}\r\n							\r\n						\r\n							{% if item.field_highest_educational_degree %}\r\n								<p><b> সর্বশেষ শিক্ষাগত যোগ্যতা</b> : {{item.field_highest_educational_degree.name}}</p>\r\n							{% endif %}	\r\n                           \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n.card-horizontal {\r\n    display: flex;\r\n    flex: 1 1 auto;\r\n}\r\n\r\n</style>'),
(113, 'details-staff_list-default', 'details-staff_list-default', '<div class=\"container-fluid\">\r\n    <div class=\"row\">\r\n        <div class=\"col-12 mt-3\">\r\n            <div class=\"card\">\r\n                <div class=\"card-horizontal\">\r\n                    <div class=\"img-square-wrapper\">\r\n                        {% set imgUrl = item.image.path? item.image.path : \'http://cdn.sylhet.gov.bd/media/central/themes/default/img/280x320.png\'%}\r\n                        <img class=\"\" src=\"{{ imgUrl }}\" alt=\"Card image cap\">\r\n                    </div>\r\n                    <div class=\"card-body\">\r\n                        <h4 class=\"card-title\">{{item.title}}</h4>\r\n                        <p>{{item.designation}}</p>\r\n                        <hr>\r\n                        <div class=\"card-text\">\r\n                           \r\n						   {% if item.mobile %} \r\n							<p><b>মোবাইল </b> : {{item.mobile}}</p>\r\n						   {% endif %}\r\n						   \r\n							{% if item.phone_office %} \r\n								<p><b>ফোন (অফিস) </b> : {{item.phone_office}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.email %}	\r\n								<p><b>ইমেইল </b> : {{item.email}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_date_of_join %}	\r\n								<p><b>বর্তমান কর্মস্থলে যোগদানের তারিখ </b> : {{item.field_date_of_join|date(\'d/m/Y\')}}</p>\r\n						    {% endif %}\r\n							\r\n                           \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n.card-horizontal {\r\n    display: flex;\r\n    flex: 1 1 auto;\r\n}\r\n\r\n</style>', '{\r\n                     \"item\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\StaffList\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"slug\",\"?slug\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"first\"\r\n                            }\r\n                            \r\n                        ]\r\n                     }\r\n                }', 1, '2020-01-08 04:27:38', '2020-01-08 04:31:41', '<div class=\"container-fluid\">\r\n    <div class=\"row\">\r\n        <div class=\"col-12 mt-3\">\r\n            <div class=\"card\">\r\n                <div class=\"card-horizontal\">\r\n                    <div class=\"img-square-wrapper\">\r\n                        {% set imgUrl = item.image.path? item.image.path : \'http://cdn.sylhet.gov.bd/media/central/themes/default/img/280x320.png\'%}\r\n                        <img class=\"\" src=\"{{ imgUrl }}\" alt=\"Card image cap\">\r\n                    </div>\r\n                    <div class=\"card-body\">\r\n                        <h4 class=\"card-title\">{{item.title}}</h4>\r\n                        <p>{{item.designation}}</p>\r\n                        <hr>\r\n                        <div class=\"card-text\">\r\n                           \r\n						   {% if item.mobile %} \r\n							<p><b>মোবাইল </b> : {{item.mobile}}</p>\r\n						   {% endif %}\r\n						   \r\n							{% if item.phone_office %} \r\n								<p><b>ফোন (অফিস) </b> : {{item.phone_office}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.email %}	\r\n								<p><b>ইমেইল </b> : {{item.email}}</p>\r\n							{% endif %}\r\n							\r\n							{% if item.field_date_of_join %}	\r\n								<p><b>বর্তমান কর্মস্থলে যোগদানের তারিখ </b> : {{item.field_date_of_join|date(\'d/m/Y\')}}</p>\r\n						    {% endif %}\r\n							\r\n                           \r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n\r\n.card-horizontal {\r\n    display: flex;\r\n    flex: 1 1 auto;