(114, 'list-financial_institutes-default', 'list-financial_institutes-default', '<h3 class=\"title\">ব্যাংক ও আর্থিক প্রতিষ্ঠানের তালিকা</h3>\r\n\r\n<ul class=\"list-group col-4md-6\">\r\n\r\n    {% for taxonomy in items %}\r\n      <li class=\"list-group-item d-flex justify-content-between align-items-center\">\r\n        <a href=\"/{{lang}}/site/view/BankFinancialOrg?category_of_bank_financial_org={{taxonomy.id}}\">{{taxonomy.name}}</a>\r\n        <span class=\"badge badge-primary badge-pill\">\r\n         {{taxonomy.finalcial_institutes_count|length > 0 ? taxonomy.finalcial_institutes_count.0.count:0}}\r\n        </span>\r\n      </li>\r\n    {% endfor %}\r\n\r\n</ul>', '{\r\n  \"items\": {\r\n    \"class\": \"Np\\Contents\\Models\\Taxonomy\",\r\n    \"methods\": [\r\n       {\r\n        \"name\": \"getFinancialInstitutesWithCount\"\r\n       }\r\n     ]\r\n  }\r\n}', 1, '2020-01-09 08:03:11', '2020-01-09 08:06:13', '');
INSERT INTO `system_mail_templates` (`id`, `code`, `subject`, `description`, `content_html`, `content_text`, `layout_id`, `is_custom`, `created_at`, `updated_at`, `content_html_en`) VALUES
(1, 'backend::mail.invite', 'Welcome to {{ appName | raw }}', 'Invite new admin to the site', 'Hello {{ name }}\r\n\r\nA user account has been created for you on **{{ appName }}**.\r\n\r\n{% partial \'panel\' body %}\r\n- Login: `{{ login ?: \'sample\' }}`\r\n- Password: `{{ (password ?: \'********\') | raw }}`\r\n{% endpartial %}\r\n\r\nYou can use the following link to sign in:\r\n\r\n{% partial \'button\' url=link body %}\r\n    Sign in to admin area\r\n{% endpartial %}\r\n\r\nAfter signing in you should change your password by clicking your name on the top right corner of the administration area.', '', 2, 1, '2019-07-29 14:23:37', '2019-08-01 22:01:01', NULL),
(2, 'backend::mail.restore', NULL, 'Reset an admin password', NULL, NULL, 2, 0, '2019-07-29 14:23:37', '2019-07-29 14:23:37', NULL),
(4, 'page-list-default', 'page-list-default', 'List Page', '<div class=\"{{code|lower}} list\">\r\n    \r\n    {% partial view_code global=common_data q=q url=url list=list domain=domain code=code _code=_code lang=lang body%}\r\n    {% endpartial %}\r\n    \r\n</div>', '', 3, 1, '2019-08-05 10:40:11', '2019-12-23 03:26:56', '<div class=\"list {{view_code}}\">\r\n    \r\n    {% partial view_code global=common_data q=q url=url list=list domain=domain code=code _code=_code lang=lang body%}\r\n    {% endpartial %}\r\n    \r\n</div>'),
(5, 'page-home-default', 'page-home-default', 'page-home-default', '<div class=\"blocks\">\r\n    {% for block in items %}\r\n        \r\n        {% if (block.type == 2) %}\r\n            \r\n            {% partial \'block-static-html\' domain=domain lang=lang global=common_data block=block body%}\r\n            {% endpartial %}\r\n            \r\n        {% elseif (block.type == 1) %}\r\n            \r\n            {% partial block.partial_code view_code=block.partial_code global=common_data domain=domain lang=lang body%}\r\n            {% endpartial %}\r\n        \r\n        {% endif %}\r\n        \r\n    {% endfor %}\r\n</div>', '{\r\n                     \"items\":{\r\n                         \r\n                        \"class\":\"Np\\Contents\\Models\\SiteBlocks\",\r\n                        \"methods\":[\r\n                            {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"status\",1]\r\n                            },\r\n                           {\r\n                                \"name\":\"where\",\r\n                                \"params\":[\"region\",\"left\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"orderBy\",\r\n                                \"params\":[\"sort_order\",\"asc\"]\r\n                            },\r\n                            {\r\n                                \"name\":\"get\"\r\n                            }\r\n                        ]\r\n                     }\r\n                }', 3, 1, '2019-08-05 12:30:30', '2019-11-19 03:51:20', '<div class=\"blocks\">\r\n    {% for block in items %}\r\n        \r\n        {% if (block.type == 2) %}\r\n            \r\n            {% partial \'site-right-block-static\' lang=lang domain=domain global=common_data block=block body%}\r\n            {% endpartial %}\r\n            \r\n        {% elseif (block.type == 1) %}\r\n            \r\n            {% partial block.partial_code global=common_data domain=domain lang=lang body%}\r\n            {% endpartial %}\r\n        \r\n        {% endif %}\r\n        \r\n    {% endfor %}\r\n</div>'),
(6, 'page-details-default', 'page-details-default', 'page-details-default', '<div class=\"{{code|lower}} details\">\r\n    \r\n    {% partial view_code url=url global=common_data data=record domain=domain _code=_code code=code lang=lang slug=slug body%}\r\n    {% endpartial %}\r\n    \r\n</div>', '', 3, 1, '2019-08-06 03:05:01', '2019-12-23 03:29:44', '<div class=\"details details-page {{view_code}}\">\r\n    \r\n    {% partial view_code url=url global=common_data data=record domain=domain _code=_code code=code lang=lang slug=slug body%}\r\n    {% endpartial %}\r\n    \r\n</div>');
